B.TM=new A.q("When you start something, the first and most crucial decision you make is whom to start it with. Choosing a co-founder is like getting married, and founder conflict is just as ugly as divorce. Optimism abounds at the start of every relationship. It\u2019s unromantic to think soberly about what could go wrong, so people don\u2019t. But if the founders develop irreconcilable differences, the company becomes the victim.\n\nIn 1999, Luke Nosek was one of my co-founders at PayPal, and I still work with him today at Founders Fund. But a year before PayPal, I invested in a company Luke started with someone else. It was his first startup; it was one of my first investments. Neither of us realized it then, but the venture was doomed to fail from the beginning because Luke and his co-founder were a terrible match. Luke is a brilliant and eccentric thinker; his co-founder was an MBA type who didn\u2019t want to miss out on the \u201990s gold rush. They met at a networking event, talked for a while, and decided to start a company together. That\u2019s no better than marrying the first person you meet at the slot machines in Vegas: you might hit the jackpot, but it probably won\u2019t work. Their company blew up and I lost my money.\n\nNow when I consider investing in a startup, I study the founding teams. Technical abilities and complementary skill sets matter, but how well the founders know each other and how well they work together matter just as much. Founders should share a prehistory before they start a company together\u2014otherwise they\u2019re just rolling dice.",null,null,B.i,!0,null)
B.U0=new A.q("OWNERSHIP, POSSESSION, AND CONTROL ",null,B.x,B.E,null,null)
B.B3=new A.aj(B.f,null,null,B.U0,null)
B.TW=new A.q("It\u2019s not just founders who need to get along. Everyone in your company needs to work well together. A Silicon Valley libertarian might say you could solve this problem by restricting yourself to a sole proprietorship. Freud, Jung, and every other psychologist has a theory about how every individual mind is divided against itself, but in business at least, working for yourself guarantees alignment. Unfortunately, it also limits what kind of company you can build. It\u2019s very hard to go from 0 to 1 without a team.\n\nA Silicon Valley anarchist might say you could achieve perfect alignment as long as you hire just the right people, who will flourish peacefully without any guiding structure. Serendipity and even free-form chaos at the workplace are supposed to help \u201cdisrupt\u201d all the old rules made and obeyed by the rest of the world. And indeed, \u201cif men were angels, no government would be necessary.\u201d But anarchic companies miss what James Madison saw: men aren\u2019t angels. That\u2019s why executives who manage companies and directors who govern them have separate roles to play; it\u2019s also why founders\u2019 and investors\u2019 claims on a company are formally defined. You need good people who get along, but you also need a structure to help keep everyone aligned for the long term.\n\nTo anticipate likely sources of misalignment in any company, it\u2019s useful to distinguish between three concepts:\n\n\u2022 Ownership: who legally owns a company\u2019s equity?\n\u2022 Possession: who actually runs the company on a day-to-day basis?\n\u2022 Control: who formally governs the company\u2019s affairs?\n\nA typical startup allocates ownership among founders, employees, and investors. The managers and employees who operate the company enjoy possession. And a board of directors, usually comprising founders and investors, exercises control.\n\nIn theory, this division works smoothly. Financial upside from part ownership attracts and rewards investors and workers. Effective possession motivates and empowers founders and employees\u2014it means they can get stuff done. Oversight from the board places managers\u2019 plans in a broader perspective. In practice, distributing these functions among different people makes sense, but it also multiplies opportunities for misalignment.\n\nTo see misalignment at its most extreme, just visit the DMV. Suppose you need a new driver\u2019s license. Theoretically, it should be easy to get one. The DMV is a government agency, and we live in a democratic republic. All power resides in \u201cthe people,\u201d who elect representatives to serve them in government. If you\u2019re a citizen, you\u2019re a part owner of the DMV and your representatives control it, so you should be able to walk in and get what you need.\n\nOf course, it doesn\u2019t work like that. We the people may \u201cown\u201d the DMV\u2019s resources, but that ownership is merely fictional. The clerks and petty tyrants who operate the DMV, however, enjoy very real possession of their small-time powers. Even the governor and the legislature charged with nominal control over the DMV can\u2019t change anything. The bureaucracy lurches ever sideways of its own inertia no matter what actions elected officials take. Accountable to nobody, the DMV is misaligned with everybody. Bureaucrats can make your licensing experience pleasurable or nightmarish at their sole discretion. You can try to bring up political theory and remind them that you are the boss, but that\u2019s unlikely to get you better service.\n\nBig corporations do better than the DMV, but they\u2019re still prone to misalignment, especially between ownership and possession. The CEO of a huge company like General Motors, for example, will own some of the company\u2019s stock, but only a trivial portion of the total. Therefore he\u2019s incentivized to reward himself through the power of possession rather than the value of ownership. Posting good quarterly results will be enough for him to keep his high salary and corporate jet. Misalignment can creep in even if he receives stock compensation in the name of \u201cshareholder value.\u201d If that stock comes as a reward for short-term performance, he will find it more lucrative and much easier to cut costs instead of investing in a plan that might create more value for all shareholders far in the future.\n\nUnlike corporate giants, early-stage startups are small enough that founders usually have both ownership and possession. Most conflicts in a startup erupt between ownership and control\u2014that is, between founders and investors on the board. The potential for conflict increases over time as interests diverge: a board member might want to take a company public as soon as possible to score a win for his venture firm, while the founders would prefer to stay private and grow the business.\n\nIn the boardroom, less is more. The smaller the board, the easier it is for the directors to communicate, to reach consensus, and to exercise effective oversight. However, that very effectiveness means that a small board can forcefully oppose management in any conflict. This is why it\u2019s crucial to choose wisely: every single member of your board matters. Even one problem director will cause you pain, and may even jeopardize your company\u2019s future.\n\nA board of three is ideal. Your board should never exceed five people, unless your company is publicly held. (Government regulations effectively mandate that public companies have larger boards\u2014the average is nine members.) By far the worst you can do is to make your board extra large. When unsavvy observers see a nonprofit organization with dozens of people on its board, they think: \u201cLook how many great people are committed to this organization! It must be extremely well run.\u201d Actually, a huge board will exercise no effective oversight at all; it merely provides cover for whatever microdictator actually runs the organization. If you want that kind of free rein from your board, blow it up to giant size. If you want an effective board, keep it small.",null,null,B.i,!0,null)
