B.TI=new A.q("As a general rule, everyone you involve with your company should be involved full-time. Sometimes you\u2019ll have to break this rule; it usually makes sense to hire outside lawyers and accountants, for example. However, anyone who doesn\u2019t own stock options or draw a regular salary from your company is fundamentally misaligned. At the margin, they\u2019ll be biased to claim value in the near term, not help you create more in the future. That\u2019s why hiring consultants doesn\u2019t work. Part-time employees don\u2019t work. Even working remotely should be avoided, because misalignment can creep in whenever colleagues aren\u2019t together full-time, in the same place, every day. If you\u2019re deciding whether to bring someone on board, the decision is binary. Ken Kesey was right: you\u2019re either on the bus or off the bus.",null,null,B.i,!0,null)
B.Sw=new A.q("CASH IS NOT KING",null,B.x,null,null,null)
B.Au=new A.aj(B.f,null,null,B.Sw,null)
B.Tp=new A.q("For people to be fully committed, they should be properly compensated. Whenever an entrepreneur asks me to invest in his company, I ask him how much he intends to pay himself. A company does better the less it pays the CEO\u2014that\u2019s one of the single clearest patterns I\u2019ve noticed from investing in hundreds of startups. In no case should a CEO of an early-stage, venture-backed startup receive more than $150,000 per year in salary. It doesn\u2019t matter if he got used to making much more than that at Google or if he has a large mortgage and hefty private school tuition bills. If a CEO collects $300,000 per year, he risks becoming more like a politician than a founder. High pay incentivizes him to defend the status quo along with his salary, not to work with everyone else to surface problems and fix them aggressively. A cash-poor executive, by contrast, will focus on increasing the value of the company as a whole.\n\nLow CEO pay also sets the standard for everyone else. Aaron Levie, the CEO of Box, was always careful to pay himself less than everyone else in the company\u2014four years after he started Box, he was still living two blocks away from HQ in a one-bedroom apartment with no furniture except a mattress. Every employee noticed his obvious commitment to the company\u2019s mission and emulated it. If a CEO doesn\u2019t set an example by taking the lowest salary in the company, he can do the same thing by drawing the highest salary. So long as that figure is still modest, it sets an effective ceiling on cash compensation.\n\nCash is attractive. It offers pure optionality: once you get your paycheck, you can do anything you want with it. However, high cash compensation teaches workers to claim value from the company as it already exists instead of investing their time to create new value in the future. A cash bonus is slightly better than a cash salary\u2014at least it\u2019s contingent on a job well done. But even so-called incentive pay encourages short-term thinking and value grabbing. Any kind of cash is more about the present than the future.",null,null,B.i,!0,null)
