B.U6=new A.q("Startups don\u2019t need to pay high salaries because they can offer something better: part ownership of the company itself. Equity is the one form of compensation that can effectively orient people toward creating value in the future.\nHowever, for equity to create commitment rather than conflict, you must allocate it very carefully. Giving everyone equal shares is usually a mistake: every individual has different talents and responsibilities as well as different opportunity costs, so equal amounts will seem arbitrary and unfair from the start. On the other hand, granting different amounts up front is just as sure to seem unfair. Resentment at this stage can kill a company, but there\u2019s no ownership formula to perfectly avoid it.\n\nThis problem becomes even more acute over time as more people join the company. Early employees usually get the most equity because they take more risk, but some later employees might be even more crucial to a venture\u2019s success. A secretary who joined eBay in 1996 might have made 200 times more than her industry-veteran boss who joined in 1999. The graffiti artist who painted Facebook\u2019s office walls in 2005 got stock that turned out to be worth $200 million, while a talented engineer who joined in 2010 might have made only $2 million. Since it\u2019s impossible to achieve perfect fairness when distributing ownership, founders would do well to keep the details secret. Sending out a company-wide email that lists everyone\u2019s ownership stake would be like dropping a nuclear bomb on your office.\n\nMost people don\u2019t want equity at all. At PayPal, we once hired a consultant who promised to help us negotiate lucrative business development deals. The only thing he ever successfully negotiated was a $5,000 daily cash salary; he refused to accept stock options as payment. Stories of startup chefs becoming millionaires notwithstanding, people often find equity unattractive. It\u2019s not liquid like cash. It\u2019s tied to one specific company. And if that company doesn\u2019t succeed, it\u2019s worthless.\n\nEquity is a powerful tool precisely because of these limitations. Anyone who prefers owning a part of your company to being paid in cash reveals a preference for the long term and a commitment to increasing your company\u2019s value in the future. Equity can\u2019t create perfect incentives, but it\u2019s the best way for a founder to keep everyone in the company broadly aligned.",null,null,B.i,!0,null)
B.Wf=new A.q("EXTENDING THE FOUNDING",null,B.x,null,null,null)
B.Bo=new A.aj(B.f,null,null,B.Wf,null)
B.UL=new A.q("Bob Dylan has said that he who is not busy being born is busy dying. If he\u2019s right, being born doesn\u2019t happen at just one moment\u2014you might even continue to do it somehow, poetically at least. The founding moment of a company, however, really does happen just once: only at the very start do you have the opportunity to set the rules that will align people toward the creation of value in the future.\n\nThe most valuable kind of company maintains an openness to invention that is most characteristic of beginnings. This leads to a second, less obvious understanding of the founding: it lasts as long as a company is creating new things, and it ends when creation stops. If you get the founding moment right, you can do more than create a valuable company: you can steer its distant future toward the creation of new things instead of the stewardship of inherited success. You might even extend its founding indefinitely. ",null,null,B.i,!0,null)
