B.Sx=new A.q("We have to find our way back to a definite future, and the Western world needs nothing short of a cultural revolution to do it.\n\nWhere to start? John Rawls will need to be displaced in philosophy departments. Malcolm Gladwell must be persuaded to change his theories. And pollsters have to be driven from politics. But the philosophy professors and the Gladwells of the world are set in their ways, to say nothing of our politicians. It\u2019s extremely hard to make changes in those crowded fields, even with brains and good intentions. A startup is the largest endeavor over which you can have definite mastery. You can have agency not just over your own life, but over a small and important part of the world. It begins by rejecting the unjust tyranny of Chance. You are not a lottery ticket.",null,null,B.i,!0,null)
B.Sy=new A.q("When Perot warned about foreign competition, both George H. W. Bush and Bill Clinton preached the gospel of free trade: since every person has a relative strength at some particular job, in theory the economy maximizes wealth when people specialize according to their advantages and then trade with each other. In practice, it\u2019s not unambiguously clear how well free trade has worked, for many workers at least. Gains from trade are greatest when there\u2019s a big discrepancy in comparative advantage, but the global supply of workers willing to do repetitive tasks for an extremely small wage is extremely large.\n\nPeople don\u2019t just compete to supply labor; they also demand the same resources. While American consumers have benefited from access to cheap toys and textiles from China, they\u2019ve had to pay higher prices for the gasoline newly desired by millions of Chinese motorists. Whether people eat shark fins in Shanghai or fish tacos in San Diego, they all need food and they all need shelter. And desire doesn\u2019t stop at subsistence\u2014people will demand ever more as globalization continues. Now that millions of Chinese peasants can finally enjoy a secure supply of basic calories, they want more of them to come from pork instead of just grain. The convergence of desire is even more obvious at the top: all oligarchs have the same taste in Cristal, from Petersburg to Pyongyang.",null,null,B.i,!0,null)
B.SA=new A.q("A monopoly business gets stronger as it gets bigger: the fixed costs of creating a product (engineering, management, office space) can be spread out over ever greater quantities of sales. Software startups can enjoy especially dramatic economies of scale because the marginal cost of producing another copy of the product is close to zero.\n\nMany businesses gain only limited advantages as they grow to large scale. Service businesses especially are difficult to make monopolies. If you own a yoga studio, for example, you\u2019ll only be able to serve a certain number of customers. You can hire more instructors and expand to more locations, but your margins will remain fairly low and you\u2019ll never reach a point where a core group of talented people can provide something of value to millions of separate clients, as software engineers are able to do.\n\nA good startup should have the potential for great scale built into its first design. Twitter already has more than 250 million users today. It doesn\u2019t need to add too many customized features in order to acquire more, and there\u2019s no inherent reason why it should ever stop growing.\n",null,null,B.i,!0,null)
B.SB=new A.q("How much of the world is actually monopolistic? How much is truly competitive? It\u2019s hard to say, because our common conversation about these matters is so confused. To the outside observer, all businesses can seem reasonably alike, so it\u2019s easy to perceive only small differences between them.\n\n",null,null,B.i,!0,null)
B.SD=new A.q("The other three views of the future can work. Definite optimism works when you build the future you envision. Definite pessimism works by building what can be copied without expecting anything new. Indefinite pessimism works because it\u2019s self-fulfilling: if you\u2019re a slacker with low expectations, they\u2019ll probably be met. But indefinite optimism seems inherently unsustainable: how can the future get better if no one plans for it?\n\nActually, most everybody in the modern world has already heard an answer to this question: progress without planning is what we call \u201cevolution.\u201d Darwin himself wrote that life tends to \u201cprogress\u201d without anybody intending it. Every living thing is just a random iteration on some other organism, and the best iterations win. Darwin\u2019s theory explains the origin of trilobites and dinosaurs, but can it be extended to domains that are far removed? Just as Newtonian physics can\u2019t explain black holes or the Big Bang, it\u2019s not clear that Darwinian biology should explain how to build a better society or how to create a new business out of nothing. Yet in recent years Darwinian (or pseudo-Darwinian) metaphors have become common in business. Journalists analogize literal survival in competitive ecosystems to corporate survival in competitive markets. Hence all the headlines like \u201cDigital Darwinism,\u201d \u201cDot-com Darwinism,\u201d and \u201cSurvival of the Clickiest.\u201d \n\nEven in engineering-driven Silicon Valley, the buzzwords of the moment call for building a \u201clean startup\u201d that can \u201cadapt\u201d and \u201cevolve\u201d to an ever-changing environment. Would-be entrepreneurs are told that nothing can be known in advance: we\u2019re supposed to listen to what customers say they want, make nothing more than a \u201cminimum viable product,\u201d and iterate our way to success.\n\nBut leanness is a methodology, not a goal. Making small changes to things that already exist might lead you to a local maximum, but it won\u2019t help you find the global maximum. You could build the best version of an app that lets people order toilet paper from their iPhone. But iteration without a bold plan won\u2019t take you from 0 to 1. A company is the strangest place of all for an indefinite optimist: why should you expect your own business to succeed without a plan to make it happen? Darwinism may be a fine theory in other contexts, but in startups, intelligent design works best.",null,null,B.i,!0,null)
B.SF=new A.q("And what if the appropriate measure isn\u2019t global solar, but rather renewable energy in general? Annual production capacity from renewables is 420 gigawatts globally; you just shrank to 0.02% of the market. And compared to the total global power generation capacity of 15,000 gigawatts, your 100 megawatts is just a drop in the ocean.",null,null,B.i,!0,null)
B.SG=new A.q("In 2006, billionaire technology investor John Doerr announced that \u201cgreen is the new red, white and blue.\u201d He could have stopped at \u201cred.\u201d As Doerr himself said, \u201cInternet-sized markets are in the billions of dollars; the energy markets are in the trillions.\u201d What he didn\u2019t say is that huge, trillion-dollar markets mean ruthless, bloody competition. Others echoed Doerr over and over: in the 2000s, I listened to dozens of cleantech entrepreneurs begin fantastically rosy PowerPoint presentations with all-too-true tales of trillion-dollar markets\u2014as if that were a good thing.\n\nCleantech executives emphasized the bounty of an energy market big enough for all comers, but each one typically believed that his own company had an edge. In 2006, Dave Pearce, CEO of solar manufacturer MiaSol\xe9, admitted to a congressional panel that his company was just one of several \u201cvery strong\u201d startups working on one particular kind of thin-film solar cell development. Minutes later, Pearce predicted that MiaSol\xe9 would become \u201cthe largest producer of thin-film solar cells in the world\u201d within a year\u2019s time. That didn\u2019t happen, but it might not have helped them anyway: thin-film is just one of more than a dozen kinds of solar cells. Customers won\u2019t care about any particular technology unless it solves a particular problem in a superior way. And if you can\u2019t monopolize a unique solution for a small market, you\u2019ll be stuck with vicious competition. That\u2019s what happened to MiaSol\xe9, which was acquired in 2013 for hundreds of millions of dollars less than its investors had put into the company.\n\nExaggerating your own uniqueness is an easy way to botch the monopoly question. Suppose you\u2019re running a solar company that\u2019s successfully installed hundreds of solar panel systems with a combined power generation capacity of 100 megawatts. Since total U.S. solar energy production capacity is 950 megawatts, you own 10.53% of the market. Congratulations, you tell yourself: you\u2019re a player.",null,null,B.i,!0,null)
