B.SJ=new A.q("Every cleantech company justified itself with conventional truths about the need for a cleaner world. They deluded themselves into believing that an overwhelming social need for alternative energy solutions implied an overwhelming business opportunity for cleantech companies of all kinds. Consider how conventional it had become by 2006 to be bullish on solar. That year, President George W. Bush heralded a future of \u201csolar roofs that will enable the American family to be able to generate their own electricity.\u201d Investor and cleantech executive Bill Gross declared that the \u201cpotential for solar is enormous.\u201d Suvi Sharma, then-CEO of solar manufacturer Solaria, admitted that while \u201cthere is a gold rush feeling\u201d to solar, \u201cthere\u2019s also real gold here\u2014or, in our case, sunshine.\u201d But rushing to embrace the convention sent scores of solar panel companies\u2014Q-Cells, Evergreen Solar, SpectraWatt, and even Gross\u2019s own Energy Innovations, to name just a few\u2014from promising beginnings to bankruptcy court very quickly. Each of the casualties had described their bright futures using broad conventions on which everybody agreed. Great companies have secrets: specific reasons for success that other people don\u2019t see.",null,null,B.i,!0,null)
