B.SR=new A.q("But the reality is much more binary than that. There\u2019s an enormous difference  between perfect competition and monopoly, and most businesses are much closer to one extreme than we commonly realize.\n\n",null,null,B.i,!0,null)
B.SU=new A.q("The first team that I built has become known in Silicon Valley as the \u201cPayPal Mafia\u201d because so many of my former colleagues have gone on to help each other start and invest in successful tech companies. We sold PayPal to eBay for $1.5 billion in 2002. Since then, Elon Musk has founded SpaceX and co-founded Tesla Motors; Reid Hoffman co-founded LinkedIn; Steve Chen, Chad Hurley, and Jawed Karim together founded YouTube; Jeremy Stoppelman and Russel Simmons founded Yelp; David Sacks co-founded Yammer; and I co-founded Palantir. Today all seven of those companies are worth more than $1 billion each. PayPal\u2019s office amenities never got much press, but the team has done extraordinarily well, both together and individually: the culture was strong enough to transcend the original company.\n\nWe didn\u2019t assemble a mafia by sorting through r\xe9sum\xe9s and simply hiring the most talented people. I had seen the mixed results of that approach firsthand when I worked at a New York law firm. The lawyers I worked with ran a valuable business, and they were impressive individuals one by one. But the relationships between them were oddly thin. They spent all day together, but few of them seemed to have much to say to each other outside the office. Why work with a group of people who don\u2019t even like each other? Many seem to think it\u2019s a sacrifice necessary for making money. But taking a merely professional view of the workplace, in which free agents check in and out on a transactional basis, is worse than cold: it\u2019s not even rational. Since time is your most valuable asset, it\u2019s odd to spend it working with people who don\u2019t envision any long-term future together. If you can\u2019t count durable relationships among the fruits of your time at work, you haven\u2019t invested your time well\u2014even in purely financial terms.\n\nFrom the start, I wanted PayPal to be tightly knit instead of transactional. I thought stronger relationships would make us not just happier and better at work but also more successful in our careers even beyond PayPal. So we set out to hire people who would actually enjoy working together. They had to be talented, but even more than that they had to be excited about working specifically with us. That was the start of the PayPal Mafia.",null,null,B.i,!0,null)
