B.T7=new A.q("Marketing and advertising work for relatively low-priced products that have mass appeal but lack any method of viral distribution. Procter & Gamble can\u2019t afford to pay salespeople to go door-to-door selling laundry detergent. (P&G does employ salespeople to talk to grocery chains and large retail outlets, since one detergent sale made to these buyers might mean 100,000 one-gallon bottles.) To reach its end user, a packaged goods company has to produce television commercials, print coupons in newspapers, and design its product boxes to attract attention.\n\nAdvertising can work for startups, too, but only when your customer acquisition costs and customer lifetime value make every other distribution channel uneconomical. Consider e-commerce startup Warby Parker, which designs and sells fashionable prescription eyeglasses online instead of contracting sales out to retail eyewear distributors. Each pair starts at around $100, so assuming the average customer buys a few pairs in her lifetime, the company\u2019s CLV is a few hundred dollars. That\u2019s too little to justify personal attention on every transaction, but at the other extreme, hundred-dollar physical products don\u2019t exactly go viral. By running advertisements and creating quirky TV commercials, Warby is able to get its better, less expensive offerings in front of millions of eyeglass-wearing customers. The company states plainly on its website that \u201cTV is a great big megaphone,\u201d and when you can only afford to spend dozens of dollars acquiring a new customer, you need the biggest megaphone you can find.\n\nEvery entrepreneur envies a recognizable ad campaign, but startups should resist the temptation to compete with bigger companies in the endless contest to put on the most memorable TV spots or the most elaborate PR stunts. I know this from experience. At PayPal we hired James Doohan, who played Scotty on Star Trek, to be our official spokesman. When we released our first software for the PalmPilot, we invited journalists to an event where they could hear James recite this immortal line: \u201cI\u2019ve been beaming people up my whole career, but this is the first time I\u2019ve ever been able to beam money!\u201d It flopped\u2014the few who actually came to cover the event weren\u2019t impressed. We were all nerds, so we had thought Scotty the Chief Engineer could speak with more authority than, say, Captain Kirk. (Just like a salesman, Kirk was always showboating out in some exotic locale and leaving it up to the engineers to bail him out of his own mistakes.) We were wrong: when Priceline.com cast William Shatner (the actor who played Kirk) in a famous series of TV spots, it worked for them. But by then Priceline was a major player. No early-stage startup can match big companies\u2019 advertising budgets. Captain Kirk truly is in a league of his own.",null,null,B.i,!0,null)
B.T8=new A.q("CREATIVE MONOPOLY means new products that benefit everybody and sustainable profits for the creator. Competition means no profits for anybody, no meaningful differentiation, and a struggle for survival. So why do people believe that competition is healthy? The answer is that competition is not just an economic concept or a simple inconvenience that individuals and companies must deal with in the marketplace. More than anything else, competition is an ideology\u2014the ideology \u2014that pervades our society and distorts our thinking. We preach competition, internalize its necessity, and enact its commandments; and as a result, we trap ourselves within it\u2014even though the more we compete, the less we gain.\n\nThis is a simple truth, but we\u2019ve all been trained to ignore it. Our educational system both drives and reflects our obsession with competition. Grades themselves allow precise measurement of each student\u2019s competitiveness; pupils with the highest marks receive status and credentials. We teach every young person the same subjects in mostly the same ways, irrespective of individual talents and preferences. Students who don\u2019t learn best by sitting still at a desk are made to feel somehow inferior, while children who excel on conventional measures like tests and assignments end up defining their identities in terms of this weirdly contrived academic parallel reality.\n\nAnd it gets worse as students ascend to higher levels of the tournament. Elite students climb confidently until they reach a level of competition sufficiently intense to beat their dreams out of them. Higher education is the place where people who had big plans in high school get stuck in fierce rivalries with equally smart peers over conventional careers like management consulting and investment banking. For the privilege of being turned into conformists, students (or their families) pay hundreds of thousands of dollars in skyrocketing tuition that continues to outpace inflation. Why are we doing this to ourselves?\n\nI wish I had asked myself when I was younger. My path was so tracked that in my 8th-grade yearbook, one of my friends predicted\u2014accurately\u2014that four years later I would enter Stanford as a sophomore. And after a conventionally successful undergraduate career, I enrolled at Stanford Law School, where I competed even harder for the standard badges of success.\n\nThe highest prize in a law student\u2019s world is unambiguous: out of tens of thousands of graduates each year, only a few dozen get a Supreme Court clerkship. After clerking on a federal appeals court for a year, I was invited to interview for clerkships with Justices Kennedy and Scalia. My meetings with the Justices went well. I was so close to winning this last competition. If only I got the clerkship, I thought, I would be set for life. But I didn\u2019t. At the time, I was devastated.\n\nIn 2004, after I had built and sold PayPal, I ran into an old friend from law school who had helped me prepare my failed clerkship applications. We hadn\u2019t spoken in nearly a decade. His first question wasn\u2019t \u201cHow are you doing?\u201d or \u201cCan you believe it\u2019s been so long?\u201d Instead, he grinned and asked: \u201cSo, Peter, aren\u2019t you glad you didn\u2019t get that clerkship?\u201d With the benefit of hindsight, we both knew that winning that ultimate competition would have changed my life for the worse. Had I actually clerked on the Supreme Court, I probably would have spent my entire career taking depositions or drafting other people\u2019s business deals instead of creating anything new. It\u2019s hard to say how much would be different, but the opportunity costs were enormous. All Rhodes Scholars had a great future in their past.",null,null,B.i,!0,null)
B.Tb=new A.q("Cleantech entrepreneurs\u2019 thinking about markets was hopelessly confused. They would rhetorically shrink their market in order to seem differentiated, only to turn around and ask to be valued based on huge, supposedly lucrative markets. But you can\u2019t dominate a submarket if it\u2019s fictional, and huge markets are highly competitive, not highly attainable. Most cleantech founders would have been better off opening a new British restaurant in downtown Palo Alto.",null,null,B.i,!0,null)
B.Td=new A.q("For Hamlet, greatness means willingness to fight for reasons as thin as an eggshell: anyone would fight for things that matter; true heroes take their personal honor so seriously they will fight for things that don\u2019t matter. This twisted logic is part of human nature, but it\u2019s disastrous in business. If you can recognize competition as a destructive force instead of a sign of value, you\u2019re already more sane than most. Then next chapter is about how to use a clear head to create a monopoly business ",null,null,B.i,!0,null)
B.Te=new A.q("OF THE SIX PEOPLE who started PayPal, four had built bombs in high school. Five were just 23 years old\u2014or younger. Four of us had been born outside the United States. Three had escaped here from communist countries: Yu Pan from China, Luke Nosek from Poland, and Max Levchin from Soviet Ukraine. Building bombs was not what kids normally did in those countries at that time.\n\nThe six of us could have been seen as eccentric. My first-ever conversation with Luke was about how he\u2019d just signed up for cryonics, to be frozen upon death in hope of medical resurrection. Max claimed to be without a country and proud of it: his family was put into diplomatic limbo when the USSR collapsed while they were escaping to the U.S. Russ Simmons had escaped from a trailer park to the top math and science magnet school in Illinois. Only Ken Howery fit the stereotype of a privileged American childhood: he was PayPal\u2019s sole Eagle Scout. But Kenny\u2019s peers thought he was crazy to join the rest of us and make just one-third of the salary he had been offered by a big bank. So even he wasn\u2019t entirely normal.",null,null,B.i,!0,null)
B.Tg=new A.q("The confusion comes from a universal bias for describing market conditions in self-serving ways: both monopolists and competitors are incentivized to bend the truth. ",null,null,B.i,!0,null)
B.Ti=new A.q("But what if the U.S. solar energy market isn\u2019t the relevant market? What if the relevant market is the global solar market, with a production capacity of 18 gigawatts? Your 100 megawatts now makes you a very small fish indeed: suddenly you own less than 1% of the market.",null,null,B.i,!0,null)
B.Tj=new A.q("What if we frame Google as a multifaceted technology company instead? This seems reasonable enough; in addition to its search engine, Google makes dozens of other software products, not to mention robotic cars, Android phones, and wearable computers. But 95% of Google\u2019s revenue comes from search advertising; its other products generated just $2.35 billion in 2012, and its consumer tech products a mere fraction of that. Since consumer tech is a $964 billion market globally, Google owns less than 0.24% of it\u2014a far cry from relevance, let alone monopoly. Framing itself as just another tech company allows Google to escape all sorts of unwanted attention. ",null,null,B.i,!0,null)
B.Tk=new A.q("START WITH A THOUGHT EXPERIMENT: what would the ideal company culture look like? Employees should love their work. They should enjoy going to the office so much that formal business hours become obsolete and nobody watches the clock. The workspace should be open, not cubicled, and workers should feel at home: beanbag chairs and Ping-Pong tables might outnumber file cabinets. Free massages, on-site sushi chefs, and maybe even yoga classes would sweeten the scene. Pets should be welcome, too: perhaps employees\u2019 dogs and cats could come and join the office\u2019s tankful of tropical fish as unofficial company mascots.\n\nWhat\u2019s wrong with this picture? It includes some of the absurd perks Silicon Valley has made famous, but none of the substance\u2014and without substance perks don\u2019t work. You can\u2019t accomplish anything meaningful by hiring an interior decorator to beautify your office, a \u201chuman resources\u201d consultant to fix your policies, or a branding specialist to hone your buzzwords. \u201cCompany culture\u201d doesn\u2019t exist apart from the company itself: no company has a culture; every company is a culture. A startup is a team of people on a mission, and a good culture is just what that looks like on the inside.",null,null,B.i,!0,null)
B.Tm=new A.q("You can see the shift to an indefinite attitude not just in politics but in the political philosophers whose ideas underpin both left and right.\n\nThe philosophy of the ancient world was pessimistic: Plato, Aristotle, Epicurus, and Lucretius all accepted strict limits on human potential. The only question was how best to cope with our tragic fate. Modern philosophers have been mostly optimistic. From Herbert Spencer on the right and Hegel in the center to Marx on the left, the 19th century shared a belief in progress. (Remember Marx and Engels\u2019s encomium to the technological triumphs of capitalism from this page.) These thinkers expected material advances to fundamentally change human life for the better: they were definite optimists.\n\nIn the late 20th century, indefinite philosophies came to the fore. The two dominant political thinkers, John Rawls and Robert Nozick, are usually seen as stark opposites: on the egalitarian left, Rawls was concerned with questions of fairness and distribution; on the libertarian right, Nozick focused on maximizing individual freedom. They both believed that people could get along with each other peacefully, so unlike the ancients, they were optimistic. But unlike Spencer or Marx, Rawls and Nozick were indefinite optimists: they didn\u2019t have any specific vision of the future.",null,null,B.i,!0,null)
B.Tn=new A.q("Now think about the prospect of competition from computers instead of competition from human workers. On the supply side, computers are far more different from people than any two people are different from each other: men and machines are good at fundamentally different things. People have intentionality\u2014we form plans and make decisions in complicated situations. We\u2019re less good at making sense of enormous amounts of data. Computers are exactly the opposite: they excel at efficient data processing, but they struggle to make basic judgments that would be simple for any human.\n\nTo understand the scale of this variance, consider another of Google\u2019s computer-for-human substitution projects. In 2012, one of their supercomputers made headlines when, after scanning 10 million thumbnails of YouTube videos, it learned to identify a cat with 75% accuracy. That seems impressive\u2014until you remember that an average four-year-old can do it flawlessly. When a cheap laptop beats the smartest mathematicians at some tasks but even a supercomputer with 16,000 CPUs can\u2019t beat a child at others, you can tell that humans and computers are not just more or less powerful than each other\u2014they\u2019re categorically different.",null,null,B.i,!0,null)
B.Tt=new A.q("Celebrities are supposedly \u201cAmerican royalty.\u201d We even grant titles to our favorite performers: Elvis Presley was the king of rock. Michael Jackson was the king of pop. Britney Spears was the pop princess.",null,null,B.i,!0,null)
B.Ts=new A.q("Monopolists lie to protect themselves. They know that bragging about their great monopoly invites being audited, scrutinized, and attacked. Since they very much want their monopoly profits to continue unmolested, they tend to do whatever they can to conceal their monopoly\u2014usually by exaggerating the power of their (nonexistent) competition.\n\nThink about how Google talks about its business. It certainly doesn\u2019t claim to be a monopoly. But is it one? Well, it depends: a monopoly in what? Let\u2019s say that Google is primarily a search engine. As of May 2014, it owns about 68% of the search market. (Its closest competitors, Microsoft and Yahoo!, have about 19% and 10%, respectively.) If that doesn\u2019t seem dominant enough, consider the fact that the word \u201cgoogle\u201d is now an official entry in the Oxford English Dictionary\u2014as a verb. Don\u2019t hold your breath waiting for that to happen to Bing.\n\nBut suppose we say that Google is primarily an advertising company. That changes things. The U.S. search engine advertising market is $17 billion annually. Online advertising is $37 billion annually. The entire U.S. advertising market is $150 billion. And global advertising is a $495 billion market. So even if Google completely monopolized U.S. search engine advertising, it would own just 3.4% of the global advertising market. From this angle, Google looks like a small player in a competitive world. ",null,null,B.i,!0,null)
B.Tu=new A.q("Silicon Valley has become obsessed with \u201cdisruption.\u201d Originally, \u201cdisruption\u201d was a term of art to describe how a firm can use new technology to introduce a low-end product at low prices, improve the product over time, and eventually overtake even the premium products offered by incumbent companies using older technology. This is roughly what happened when the advent of PCs disrupted the market for mainframe computers: at first PCs seemed irrelevant, then they became dominant. Today mobile devices may be doing the same thing to PCs.\n\nHowever, disruption has recently transmogrified into a self-congratulatory buzzword for anything posing as trendy and new. This seemingly trivial fad matters because it distorts an entrepreneur\u2019s self-understanding in an inherently competitive way. The concept was coined to describe threats to incumbent companies, so startups\u2019 obsession with disruption means they see themselves through older firms\u2019 eyes. If you think of yourself as an insurgent battling dark forces, it\u2019s easy to become unduly fixated on the obstacles in your path. But if you truly want to make something new, the act of creation is far more important than the old industries that might not like what you create. Indeed, if your company can be summed up by its opposition to already existing firms, it can\u2019t be completely new and it\u2019s probably not going to become a monopoly.\n\nDisruption also attracts attention: disruptors are people who look for trouble and find it. Disruptive kids get sent to the principal\u2019s office. Disruptive companies often pick fights they can\u2019t win. Think of Napster: the name itself meant trouble. What kinds of things can one \u201cnap\u201d? Music ... Kids ... and perhaps not much else. Shawn Fanning and Sean Parker, Napster\u2019s then-teenage founders, credibly threatened to disrupt the powerful music recording industry in 1999. The next year, they made the cover of Time magazine. A year and a half after that, they ended up in bankruptcy court.\n\nPayPal could be seen as disruptive, but we didn\u2019t try to directly challenge any large competitor. It\u2019s true that we took some business away from Visa when we popularized internet payments: you might use PayPal to buy something online instead of using your Visa card to buy it in a store. But since we expanded the market for payments overall, we gave Visa far more business than we took. The overall dynamic was net positive, unlike Napster\u2019s negative-sum struggle with the U.S. recording industry. As you craft a plan to expand to adjacent markets, don\u2019t disrupt: avoid competition as much as possible.",null,null,B.i,!0,null)
B.Tv=new A.q("New technology tends to come from new ventures\u2014startups. From the Founding Fathers in politics to the Royal Society in science to Fairchild Semiconductor\u2019s \u201ctraitorous eight\u201d in business, small groups of people bound together by a sense of mission have changed the world for the better. The easiest explanation for this is negative: it\u2019s hard to develop new things in big organizations, and it\u2019s even harder to do it by yourself. Bureaucratic hierarchies move slowly, and entrenched interests shy away from risk. In the most dysfunctional organizations, signaling that work is being done becomes a better strategy for career advancement than actually doing work (if this describes your company, you should quit now). At the other extreme, a lone genius might create a classic work of art or literature, but he could never create an entire industry. Startups operate on the principle that you need to work with other people to get stuff done, but you also need to stay small enough so that you actually can.\n\nPositively defined, a startup is the largest group of people you can convince of a plan to build a different future. A new company\u2019s most important strength is new thinking: even more important than nimbleness, small size affords space to think. This book is about the questions you must ask and answer to succeed in the business of doing new things: what follows is not a manual or a record of knowledge but an exercise in thinking. Because that is what a startup has to do: question received ideas and rethink business from scratch. ",null,null,B.i,!0,null)
B.QD=new A.l(!0,B.l,null,null,null,null,36,B.a9,null,null,null,B.t,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
B.Tw=new A.q("Transform Your Thinking About Innovation",null,B.QD,B.E,null,null)
B.Tz=new A.q("Non-monopolists exaggerate their distinction by defining their market as the intersection of various smaller markets:\n\nBritish food \u2229 restaurant \u2229 Palo Alto\n\nRap star \u2229 hackers \u2229 sharks\n\nMonopolists, by contrast, disguise their monopoly by framing their market as the union of several large markets:\n\nsearch engine \u222a mobile phones \u222a wearable computers \u222a self-driving cars\n\nWhat does a monopolist\u2019s union story look like in practice? Consider a statement from Google chairman Eric Schmidt\u2019s testimony at a 2011 congressional hearing:\n\nWe face an extremely competitive landscape in which consumers have a multitude of options to access information.\n\nOr, translated from PR-speak to plain English: Google is a small fish in a big pond. We could be swallowed whole at any time. We are not the monopoly that the government is looking for.",null,null,B.i,!0,null)
B.TA=new A.q("ESCAPING COMPETITION will give you a monopoly, but even a monopoly is only a great business if it can endure in the future. Compare the value of the New York Times Company with Twitter. Each employs a few thousand people, and each gives millions of people a way to get news. But when Twitter went public in 2013, it was valued at $24 billion\u2014more than 12 times the Times\u2019s market capitalization\u2014even though the Times earned $133 million in 2012 while Twitter lost money. What explains the huge premium for Twitter?\n\nThe answer is cash flow. This sounds bizarre at first, since the Times was profitable while Twitter wasn\u2019t. But a great business is defined by its ability to generate cash flows in the future. Investors expect Twitter will be able to capture monopoly profits over the next decade, while newspapers\u2019 monopoly days are over. Simply stated, the value of a business today is the sum of all the money it will make in the future. (To properly value a business, you also have to discount those future cash flows to their present worth, since a given amount of money today is worth more than the same amount in the future.)\n\nComparing discounted cash flows shows the difference between low-growth businesses and high-growth startups at its starkest. Most of the value of low-growth businesses is in the near term. An Old Economy business (like a newspaper) might hold its value if it can maintain its current cash flows for five or six years. However, any firm with close substitutes will see its profits competed away. Nightclubs or restaurants are extreme examples: successful ones might collect healthy amounts today, but their cash flows will probably dwindle over the next few years when customers move on to newer and trendier alternatives.\n\nTechnology companies follow the opposite trajectory. They often lose money for the first few years: it takes time to build valuable things, and that means delayed revenue. Most of a tech company\u2019s value will come at least 10 to 15 years in the future.\n",null,null,B.i,!0,null)
B.TB=new A.q("Tesla\u2019s success proves that there was nothing inherently wrong with cleantech. The biggest idea behind it is right: the world really will need new sources of energy. Energy is the master resource: it\u2019s how we feed ourselves, build shelter, and make everything we need to live comfortably. Most of the world dreams of living as comfortably as Americans do today, and globalization will cause increasingly severe energy challenges unless we build new technology. There simply aren\u2019t enough resources in the world to replicate old approaches or redistribute our way to prosperity.\n\nCleantech gave people a way to be optimistic about the future of energy. But when indefinitely optimistic investors betting on the general idea of green energy funded cleantech companies that lacked specific business plans, the result was a bubble. Plot the valuation of alternative energy firms in the 2000s alongside the NASDAQ\u2019s rise and fall a decade before, and you see the same shape:",null,null,B.i,!0,null)
B.TD=new A.q("In between personal sales (salespeople obviously required) and traditional advertising (no salespeople required) there is a dead zone. Suppose you create a software service that helps convenience store owners track their inventory and manage ordering. For a product priced around $1,000, there might be no good distribution channel to reach the small businesses that might buy it. Even if you have a clear value proposition, how do you get people to hear it? Advertising would either be too broad (there\u2019s no TV channel that only convenience store owners watch) or too inefficient (on its own, an ad in Convenience Store News probably won\u2019t convince any owner to part with $1,000 a year). The product needs a personal sales effort, but at that price point, you simply don\u2019t have the resources to send an actual person to talk to every prospective customer. This is why so many small and medium-sized businesses don\u2019t use tools that bigger firms take for granted. It\u2019s not that small business proprietors are unusually backward or that good tools don\u2019t exist: distribution is the hidden bottleneck.",null,null,B.i,!0,null)
B.TE=new A.q("A definite pessimist believes the future can be known, but since it will be bleak, he must prepare for it. Perhaps surprisingly, China is probably the most definitely pessimistic place in the world today. When Americans see the Chinese economy grow ferociously fast (10% per year since 2000), we imagine a confident country mastering its future. But that\u2019s because Americans are still optimists, and we project our optimism onto China. From China\u2019s viewpoint, economic growth cannot come fast enough. Every other country is afraid that China is going to take over the world; China is the only country afraid that it won\u2019t.\n\nChina can grow so fast only because its starting base is so low. The easiest way for China to grow is to relentlessly copy what has already worked in the West. And that\u2019s exactly what it\u2019s doing: executing definite plans by burning ever more coal to build ever more factories and skyscrapers. But with a huge population pushing resource prices higher, there\u2019s no way Chinese living standards can ever actually catch up to those of the richest countries, and the Chinese know it.\n\nThis is why the Chinese leadership is obsessed with the way in which things threaten to get worse. Every senior Chinese leader experienced famine as a child, so when the Politburo looks to the future, disaster is not an abstraction. The Chinese public, too, knows that winter is coming. Outsiders are fascinated by the great fortunes being made inside China, but they pay less attention to the wealthy Chinese trying hard to get their money out of the country. Poorer Chinese just save everything they can and hope it will be enough. Every class of people in China takes the future deadly seriously.\n\n",null,null,B.i,!0,null)
B.TG=new A.q("What Tech Leaders Say about this book",null,B.jQ,null,null,null)
B.TH=new A.q("The power law is not just important to investors; rather, it\u2019s important to everybody because everybody is an investor. An entrepreneur makes a major investment just by spending her time working on a startup. Therefore every entrepreneur must think about whether her company is going to succeed and become valuable. Every individual is unavoidably an investor, too. When you choose a career, you act on your belief that the kind of work you do will be valuable decades from now.\n\nThe most common answer to the question of future value is a diversified portfolio: \u201cDon\u2019t put all your eggs in one basket,\u201d everyone has been told. As we said, even the best venture investors have a portfolio, but investors who understand the power law make as few investments as possible. The kind of portfolio thinking embraced by both folk wisdom and financial convention, by contrast, regards diversified betting as a source of strength. The more you dabble, the more you are supposed to have hedged against the uncertainty of the future.\n\nBut life is not a portfolio: not for a startup founder, and not for any individual. An entrepreneur cannot \u201cdiversify\u201d herself: you cannot run dozens of companies at the same time and then hope that one of them works out well. Less obvious but just as important, an individual cannot diversify his own life by keeping dozens of equally possible careers in ready reserve.\n\nOur schools teach the opposite: institutionalized education traffics in a kind of homogenized, generic knowledge. Everybody who passes through the American school system learns not to think in power law terms. Every high school course period lasts 45 minutes whatever the subject. Every student proceeds at a similar pace. At college, model students obsessively hedge their futures by assembling a suite of exotic and minor skills. Every university believes in \u201cexcellence,\u201d and hundred-page course catalogs arranged alphabetically according to arbitrary departments of knowledge seem designed to reassure you that \u201cit doesn\u2019t matter what you do, as long as you do it well.\u201d That is completely false. It does matter what you do. You should focus relentlessly on something you\u2019re good at doing, but before that you must think hard about whether it will be valuable in the future.\n\nFor the startup world, this means you should not necessarily start your own company, even if you are extraordinarily talented. If anything, too many people are starting their own companies today. People who understand the power law will hesitate more than others when it comes to founding a new venture: they know how tremendously successful they could become by joining the very best company while it\u2019s growing fast. The power law means that differences between companies will dwarf the differences in roles inside companies. You could have 100% of the equity if you fully fund your own venture, but if it fails you\u2019ll have 100% of nothing. Owning just 0.01% of Google, by contrast, is incredibly valuable (more than $35 million as of this writing).\n\nIf you do start your own company, you must remember the power law to operate it well. The most important things are singular: One market will probably be better than all others, as we discussed in Chapter 5. One distribution strategy usually dominates all others, too\u2014for that see Chapter 11. Time and decision-making themselves follow a power law, and some moments matter far more than others\u2014see Chapter 9. However, you can\u2019t trust a world that denies the power law to accurately frame your decisions for you, so what\u2019s most important is rarely obvious. It might even be secret. But in a power law world, you can\u2019t afford not to think hard about where your actions will fall on the curve.",null,null,B.i,!0,null)
B.TO=new A.q("Network effects make a product more useful as more people use it. For example, if all your friends are on Facebook, it makes sense for you to join Facebook, too. Unilaterally choosing a different social network would only make you an eccentric. Network effects can be powerful, but you\u2019ll never reap them unless your product is valuable to its very first users when the network is necessarily small. For example, in 1960 a quixotic company called Xanadu set out to build a two-way communication network between all computers\u2014a sort of early, synchronous version of the World Wide Web. After more than three decades of futile effort, Xanadu folded just as the web was becoming commonplace. Their technology probably would have worked at scale, but it could have worked only at scale: it required every computer to join the network at the same time, and that was never going to happen.\n\nParadoxically, then, network effects businesses must start with especially small markets. Facebook started with just Harvard students\u2014Mark Zuckerberg\u2019s first product was designed to get all his classmates signed up, not to attract all people of Earth. This is why successful network businesses rarely get started by MBA types: the initial markets are so small that they often don\u2019t even appear to be business opportunities at all.\n",null,null,B.i,!0,null)
B.TS=new A.q("When I was running PayPal in late 1999, I was scared out of my wits\u2014not because I didn\u2019t believe in our company, but because it seemed like everyone else in the Valley was ready to believe anything at all. Everywhere I looked, people were starting and flipping companies with alarming casualness. One acquaintance told me how he had planned an IPO from his living room before he\u2019d even incorporated his company\u2014 and he didn\u2019t think that was weird. In this kind of environment, acting sanely began to seem eccentric.\n\nAt least PayPal had a suitably grand mission\u2014the kind that post-bubble skeptics would later describe as grandiose: we wanted to create a new internet currency to replace the U.S. dollar. Our first product let people beam money from one PalmPilot to another. However, nobody had any use for that product except the journalists who voted it one of the 10 worst business ideas of 1999. PalmPilots were still too exotic then, but email was already commonplace, so we decided to create a way to send and receive payments over email.\n\nBy the fall of \u201999, our email payment product worked well\u2014anyone could log in to our website and easily transfer money. But we didn\u2019t have enough customers, growth was slow, and expenses mounted. For PayPal to work, we needed to attract acritical mass of at least a million users. Advertising was too ineffective to justify the cost. Prospective deals with big banks kept falling through. So we decided to pay people to sign up.\n\nWe gave new customers $10 for joining, and we gave them $10 more every time they referred a friend. This got us hundreds of thousands of new customers and an exponential growth rate. Of course, this customer acquisition strategy was unsustainable on its own\u2014when you pay people to be your customers, exponential growth means an exponentially growing cost structure. Crazy costs were typical at that time in the Valley. But we thought our huge costs were sane: given a large user base, PayPal had a clear path to profitability by taking a small fee on customers\u2019 transactions.\n\nWe knew we\u2019d need more funding to reach that goal. We also knew that the boom was going to end. Since we didn\u2019t expect investors\u2019 faith in our mission to survive the coming crash, we moved fast to raise funds while we could. On February 16, 2000, the Wall Street Journal ran a story lauding our viral growth and suggesting that PayPal was worth $500 million. When we raised $100 million the next month, our lead investor took the Journal\u2019s back-of-the-envelope valuation as authoritative. (Other investors were in even more of a hurry. A South Korean firm wired us $5 million without first negotiating a deal or signing any documents. When I tried to return the money, they wouldn\u2019t tell me where to send it.) That March 2000 financing round bought us the time we needed to make PayPal a success. Just as we closed the deal, the bubble popped. ",null,null,B.i,!0,null)
B.TT=new A.q("Extreme founder figures are not new in human affairs. Classical mythology is full of them. Oedipus is the paradigmatic insider/outsider: he was abandoned as an infant and ended up in a foreign land, but he was a brilliant king and smart enough to solve the riddle of the Sphinx.\n\nRomulus and Remus were born of royal blood and abandoned as orphans. When they discovered their pedigree, they decided to found a city. But they couldn\u2019t agree on where to put it. When Remus crossed the boundary that Romulus had decided was the edge of Rome, Romulus killed him, declaring: \u201cSo perish every one that shall hereafter leap over my wall.\u201d Law-maker and law-breaker, criminal outlaw and king who defined Rome, Romulus was a self-contradictory insider/outsider.\n\nNormal people aren\u2019t like Oedipus or Romulus. Whatever those individuals were actually like in life, the mythologized versions of them remember only the extremes. But why was it so important for archaic cultures to remember extraordinary people? The famous and infamous have always served as vessels for public sentiment: they\u2019re praised amid prosperity and blamed for misfortune. Primitive societies faced one fundamental problem above all: they would be torn apart by conflict if they didn\u2019t have a way to stop it. So whenever plagues, disasters, or violent rivalries threatened the peace, it was beneficial for the society to place the entire blame on a single person, someone everybody could agree on: a scapegoat.\n\nWho makes an effective scapegoat? Like founders, scapegoats are extreme and contradictory figures. On the one hand, a scapegoat is necessarily weak; he is powerless to stop his own victimization. On the other hand, as the one who can defuse conflict by taking the blame, he is the most powerful member of the community.\n\nBefore execution, scapegoats were often worshipped like deities. The Aztecs considered their victims to be earthly forms of the gods to whom they were sacrificed. You would be dressed in fine clothes and feast royally until your brief reign ended and they cut your heart out. These are the roots of monarchy: every king was a living god, and every god a murdered king. Perhaps every modern king is just a scapegoat who has managed to delay his own execution.",null,null,B.i,!0,null)
B.TX=new A.q("For some fallen stars, death brings resurrection. So many popular musicians have died at age 27\u2014Janis Joplin, Jimi Hendrix, Jim Morrison, and Kurt Cobain, for example\u2014that this set has become immortalized as the \u201c27 Club.\u201d Before she joined the club in 2011, Amy Winehouse sang: \u201cThey tried to make me go to rehab, but I said, \u2018No, no, no.\u2019 \u201d Maybe rehab seemed so unattractive because it blocked the path to immortality. Perhaps the only way to be a rock god forever is to die an early death.",null,null,B.i,!0,null)
B.TY=new A.q("Non-monopolists tell the opposite lie: \u201cwe\u2019re in a league of our own.\u201d Entrepreneurs are always biased to understate the scale of competition, but that is the biggest mistake a startup can make. The fatal temptation is to describe your market extremely narrowly so that you dominate it by definition.\n\nSuppose you want to start a restaurant that serves British food in Palo Alto. \u201cNo one else is doing it,\u201d you might reason. \u201cWe\u2019ll own the entire market.\u201d But that\u2019s only true if the relevant market is the market for British food specifically. What if the actual market is the Palo Alto restaurant market in general? And what if all the restaurants in nearby towns are part of the relevant market as well?\n\nThese are hard questions, but the bigger problem is that you have an incentive not to ask them at all. When you hear that most new restaurants fail within one or two years, your instinct will be to come up with a story about how yours is different. You\u2019ll spend time trying to convince people that you are exceptional instead of seriously considering whether that\u2019s true. It would be better to pause and consider whether there are people in Palo Alto who would rather eat British food above all else. It\u2019s very possible they don\u2019t exist.\n\nIn 2001, my co-workers at PayPal and I would often get lunch on Castro Street in Mountain View. We had our pick of restaurants, starting with obvious categories like Indian, sushi, and burgers. There were more options once we settled on a type: North Indian or South Indian, cheaper or fancier, and so on. In contrast to the competitive local restaurant market, PayPal was at that time the only email-based payments company in the world. We employed fewer people than the restaurants on Castro Street did, but our business was much more valuable than all of those restaurants combined. Starting a new South Indian restaurant is a really hard way to make money. If you lose sight of competitive reality and focus on trivial differentiating factors\u2014maybe you think your naan is superior because of your great-grandmother\u2019s recipe\u2014your business is unlikely to survive.\n\nCreative industries work this way, too. No screenwriter wants to admit that her new movie script simply rehashes what has already been done before. Rather, the pitch is: \u201cThis film will combine various exciting elements in entirely new ways.\u201d It could even be true. Suppose her idea is to have Jay-Z star in a cross between Hackers and Jaws: rap star joins elite group of hackers to catch the shark that killed his friend. That has definitely never been done before. But, like the lack of British restaurants in Palo Alto, maybe that\u2019s a good thing. ",null,null,B.i,!0,null)
B.jR=new A.l(!0,null,null,null,null,null,null,null,B.aX,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
B.TZ=new A.q("Still round the corner there may wait\nA new road or a secret gate,\nAnd though we pass them by today,\nTomorrow we may come this way\nAnd take the hidden paths that run\nTowards the Moon or to the Sun.\n",null,B.jR,B.i,!0,null)
B.U2=new A.q("A college dropout who walked around barefoot and refused to shower, Jobs was also the insider of his own personality cult. He could act charismatic or crazy, perhaps according to his mood or perhaps according to his calculations; it\u2019s hard to believe that such weird practices as apple-only diets weren\u2019t part of a larger strategy. But all this eccentricity backfired on him in 1985: Apple\u2019s board effectively kicked Jobs out of his own company when he clashed with the professional CEO brought in to provide adult supervision.\n\nJobs\u2019s return to Apple 12 years later shows how the most important task in business\u2014the creation of new value\u2014cannot be reduced to a formula and applied by professionals. When he was hired as interim CEO of Apple in 1997, the impeccably credentialed executives who preceded him had steered the company nearly to bankruptcy. That year Michael Dell famously said of Apple, \u201cWhat would I do? I\u2019d shut it down and give the money back to the shareholders.\u201d Instead Jobs introduced the iPod (2001), the iPhone (2007), and the iPad (2010) before he had to resign in 2011 because of poor health. By the following year Apple was the single most valuable company in the world.\n\nApple\u2019s value crucially depended on the singular vision of a particular person. This hints at the strange way in which the companies that create new technology often resemble feudal monarchies rather than organizations that are supposedly more \u201cmodern.\u201d A unique founder can make authoritative decisions, inspire strong personal loyalty, and plan ahead for decades. Paradoxically, impersonal bureaucracies staffed by trained professionals can last longer than any lifetime, but they usually act with short time horizons.\n\nThe lesson for business is that we need founders. If anything, we should be more tolerant of founders who seem strange or extreme; we need unusual individuals to lead companies beyond mere incrementalism. The lesson for founders is that individual prominence and adulation can never be enjoyed except on the condition that it may be exchanged for individual notoriety and demonization at any moment\u2014so be careful.\n\nAbove all, don\u2019t overestimate your own power as an individual. Founders are important not because they are the only ones whose work has value, but rather because a great founder can bring out the best work from everybody at his company. That we need individual founders in all their peculiarity does not mean that we are called to worship Ayn Randian \u201cprime movers\u201d who claim to be independent of everybody around them. In this respect Rand was a merely half-great writer: her villains were real, but her heroes were fake. There is no Galt\u2019s Gulch. There is no secession from society. To believe yourself invested with divine self-sufficiency is not the mark of a strong individual, but of a person who has mistaken the crowd\u2019s worship\u2014or jeering\u2014for the truth. The single greatest danger for a founder is to become so certain of his own myth that he loses his mind. But an equally insidious danger for every business is to lose all sense of myth and mistake disenchantment for wisdom.",null,null,B.i,!0,null)
B.U1=new A.q("Tesla is one of the few cleantech companies started last decade to be thriving today. They rode the social buzz of cleantech better than anyone, but they got the seven questions right, so their success is instructive:\n\nTECHNOLOGY. Tesla\u2019s technology is so good that other car companies rely on it: Daimler uses Tesla\u2019s battery packs; Mercedes-Benz uses a Tesla powertrain; Toyota uses a Tesla motor. General Motors has even created a task force to track Tesla\u2019s next moves. But Tesla\u2019s greatest technological achievement isn\u2019t any single part or component, but rather its ability to integrate many components into one superior product. The Tesla Model S sedan, elegantly designed from end to end, is more than the sum of its parts: Consumer Reports rated it higher than any other car ever reviewed, and both Motor Trend and Automobile magazines named it their 2013 Car of the Year.\n\nTIMING. In 2009, it was easy to think that the government would continue to support cleantech: \u201cgreen jobs\u201d were a political priority, federal funds were already earmarked, and Congress even seemed likely to pass cap-and-trade legislation. But where others saw generous subsidies that could flow indefinitely, Tesla CEO Elon Musk rightly saw a one-time-only opportunity. In January 2010\u2014about a year and a half before Solyndra imploded under the Obama administration and politicized the subsidy question\u2014Tesla secured a $465 million loan from the U.S. Department of Energy. A half-billion-dollar subsidy was unthinkable in the mid-2000s. It\u2019s unthinkable today. There was only one moment where that was possible, and Tesla played it perfectly.\n\nMONOPOLY. Tesla started with a tiny submarket that it could dominate: the market for high-end electric sports cars. Since the first Roadster rolled off the production line in 2008, Tesla\u2019s sold only about 3,000 of them, but at $109,000 apiece that\u2019s not trivial. Starting small allowed Tesla to undertake the necessary R&D to build the slightly less expensive Model S, and now Tesla owns the luxury electric sedan market, too. They sold more than 20,000 sedans in 2013 and now Tesla is in prime position to expandto broader markets in the future.\n\nTEAM. Tesla\u2019s CEO is the consummate engineer and salesman, so it\u2019s not surprising that he\u2019s assembled a team that\u2019s very good at both. Elon describes his staff this way: \u201cIf you\u2019re at Tesla, you\u2019re choosing to be at the equivalent of Special Forces. There\u2019s the regular army, and that\u2019s fine, but if you are working at Tesla, you\u2019re choosing to step up your game.\u201d\n\nDISTRIBUTION. Most companies underestimate distribution, but Tesla took it so seriously that it decided to own the entire distribution chain. Other car companies are beholden to independent dealerships: Ford and Hyundai make cars, but they rely on other people to sell them. Tesla sells and services its vehicles in its own stores. The up-front costs of Tesla\u2019s approach are much higher than traditional dealership distribution, but it affords control over the customer experience, strengthens Tesla\u2019s brand, and saves the company money in the long run.\n\nDURABILITY. Tesla has a head start and it\u2019s moving faster than anyone else \u2014and that combination means its lead is set to widen in the years ahead. A coveted brand is the clearest sign of Tesla\u2019s breakthrough: a car is one of the biggest purchasing decisions that people ever make, and consumers\u2019 trust in that category is hard to win. And unlike every other car company, at Tesla the founder is still in charge, so it\u2019s not going to ease off anytime soon.\n\nSECRETS. Tesla knew that fashion drove interest in cleantech. Rich people especially wanted to appear \u201cgreen,\u201d even if it meant driving a boxy Prius or clunky Honda Insight. Those cars only made drivers look cool by association with the famous eco-conscious movie stars who owned them as well. So Tesla decided to build cars that made drivers look cool, period \u2014Leonardo DiCaprio even ditched his Prius for an expensive (and expensive-looking) Tesla Roadster. While generic cleantech companies struggled to differentiate themselves, Tesla built a unique brand around the secret that cleantech was even more of a social phenomenon than an environmental imperative.",null,null,B.i,!0,null)
B.U4=new A.q("Until they weren\u2019t. Elvis self-destructed in the \u201970s and died alone, overweight, sitting on his toilet. Today, his impersonators are fat and sketchy, not lean and cool. Michael Jackson went from beloved child star to an erratic, physically repulsive, drug-addicted shell of his former self; the world reveled in the details of his trials.  Britney\u2019s story is the most dramatic of all. We created her from nothing, elevating her to superstardom as a teenager. But then everything fell off the tracks: witness the shaved head, the over-and under-eating scandals, and the highly publicized court case to take away her children. Was she always a little bit crazy? Did the publicity just get to her? Or did she do it all to get more?",null,null,B.i,!0,null)
B.U7=new A.q("The NASDAQ reached 5,048 at its peak in the middle of March 2000 and then crashed to 3,321 in the middle of April. By the time it bottomed out at 1,114 in October 2002, the country had long since interpreted the market\u2019s collapse as a kind of divine judgment against the technological optimism of the \u201990s. The era of cornucopian hope was relabeled as an era of crazed greed and declared to be definitely over.\n\nEveryone learned to treat the future as fundamentally indefinite, and to dismiss as an extremist anyone with plans big enough to be measured in years instead of quarters. Globalization replaced technology as the hope for the future. Since the \u201990s migration \u201cfrom bricks to clicks\u201d didn\u2019t work as hoped, investors went back to bricks (housing) and BRICs (globalization). The result was another bubble, this time in real estate.\n",null,null,B.i,!0,null)
B.U8=new A.q("You\u2019ve probably heard about \u201cfirst mover advantage\u201d: if you\u2019re the first entrant into  a market, you can capture significant market share while competitors scramble to get  started. But moving first is a tactic, not a goal. What really matters is generating cash flows in the future, so being the first mover doesn\u2019t do you any good if someone else comes along and unseats you. It\u2019s much better to be the last mover\u2014that is, to make the last great development in a specific market and enjoy years or even decades of monopoly profits. The way to do that is to dominate a small niche and scale up from there, toward your ambitious long-term vision. In this one particular at least, business is like chess. Grandmaster Jos\xe9 Ra\xfal Capablanca put it well: to succeed, \u201cyou must study the endgame before everything else.\u201d",null,null,B.i,!0,null)
B.U9=new A.q("AT THE START of the 21st century, everyone agreed that the next big thing was clean technology. It had to be: in Beijing, the smog had gotten so bad that people couldn\u2019t see from building to building\u2014even breathing was a health risk. Bangladesh, with its arsenic-laden water wells, was suffering what the New York Times called \u201cthe biggest mass poisoning in history.\u201d In the U.S., Hurricanes Ivan and Katrina were said to be harbingers of the coming devastation from global warming. Al Gore implored us to attack these problems \u201cwith the urgency and resolve that has previously been seen only when nations mobilized for war.\u201d People got busy: entrepreneurs started thousands of cleantech companies, and investors poured more than $50 billion into them. So began the quest to cleanse the world.\n\nIt didn\u2019t work. Instead of a healthier planet, we got a massive cleantech bubble. Solyndra is the most famous green ghost, but most cleantech companies met similarly disastrous ends\u2014more than 40 solar manufacturers went out of business or filed for bankruptcy in 2012 alone. The leading index of alternative energy companies shows the bubble\u2019s dramatic deflation:",null,null,B.i,!0,null)
B.Ub=new A.q("One of these methods is likely to be far more powerful than every other for any given business: distribution follows a power law of its own. This is counterintuitive for most entrepreneurs, who assume that more is more. But the kitchen sink approach\u2014employ a few salespeople, place some magazine ads, and try to add some kind of viral functionality to the product as an afterthought\u2014doesn\u2019t work. Most businesses get zero distribution channels to work: poor sales rather than bad product is the most common cause of failure. If you can get just one distribution channel to work, you have a great business. If you try for several but don\u2019t nail one, you\u2019re finished.",null,null,B.i,!0,null)
B.Uc=new A.q("Just as the legal attack on Microsoft was ending Bill Gates\u2019s dominance, Steve Jobs\u2019s return to Apple demonstrated the irreplaceable value of a company\u2019s founder. In some ways, Steve Jobs and Bill Gates were opposites. Jobs was an artist, preferred closed systems, and spent his time thinking about great products above all else; Gates was a businessman, kept his products open, and wanted to run the world. But both were insider/outsiders, and both pushed the companies they started to achievements that nobody else would have been able to match.",null,null,B.i,!0,null)
B.Ud=new A.q("Dot-com mania was intense but short\u201418 months of insanity from September 1998 to March 2000. It was a Silicon Valley gold rush: there was money everywhere, and no shortage of exuberant, often sketchy people to chase it. Every week, dozens of new startups competed to throw the most lavish launch party. (Landing parties were much more rare.) Paper millionaires would rack up thousand-dollar dinner bills and try to pay with shares of their startup\u2019s stock\u2014sometimes it even worked. Legions of people decamped from their well-paying jobs to found or join startups. One 40- something grad student that I knew was running six different companies in 1999. (Usually, it\u2019s considered weird to be a 40-year-old graduate student. Usually, it\u2019s considered insane to start a half-dozen companies at once. But in the late \u201990s, people could believe that was a winning combination.) Everybody should have known that the mania was unsustainable; the most \u201csuccessful\u201d companies seemed to embrace a sort of anti-business model where they lost money as they grew. But it\u2019s hard to blame people for dancing when the music was playing; irrationality was rational given that appending \u201c.com\u201d to your name could double your value overnight.\n",null,null,B.i,!0,null)
B.Uf=new A.q("FWe alternately worship and despise technology founders just as we do celebrities. Howard Hughes\u2019s arc from fame to pity is the most dramatic of any 20th-century tech founder. He was born wealthy, but he was always more interested in engineering than luxury. He built Houston\u2019s first radio transmitter at the age of 11. The year after that he built the city\u2019s first motorcycle. By age 30 he\u2019d made nine commercially successful movies at a time when Hollywood was on the technological frontier. But Hughes was even more famous for his parallel career in aviation. He designed planes, produced them, and piloted them himself. Hughes set world records for top airspeed, fastest transcontinental flight, and fastest flight around the world. Hughes was obsessed with flying higher than everyone else. He liked to remind people that he was a mere mortal, not a Greek god\u2014something that mortals say only when they want to invite comparisons to gods. Hughes was \u201ca man to whom you cannot apply the same standards as you can to you and me,\u201d his lawyer once argued in federal court. Hughes paid the lawyer to say that, but according to the New York Times there was \u201cno dispute on this point from judge or jury.\u201d When Hughes was awarded the Congressional Gold Medal in 1939 for his achievements in aviation, he didn\u2019t even show up to claim it\u2014years later President Truman found it in the White House and mailed it to him.\n\nThe beginning of Hughes\u2019s end came in 1946, when he suffered his third and worst plane crash. Had he died then, he would have been remembered forever as one of the most dashing and successful Americans of all time. But he survived\u2014barely. He became obsessive-compulsive, addicted to painkillers, and withdrew from the public to spend the last 30 years of his life in self-imposed solitary confinement. Hughes had always acted a little crazy, on the theory that fewer people would want to bother a crazy person. But when his crazy act turned into a crazy life, he became an object of pity as much as awe.",null,null,B.i,!0,null)
B.Ug=new A.q("What kind of future will our indefinitely optimistic decisions bring about? If American households were saving, at least they could expect to have money to spend later. And if American companies were investing, they could expect to reap the rewards of new wealth in the future. But U.S. households are saving almost nothing. And U.S. companies are letting cash pile up on their balance sheets without investing in new projects because they don\u2019t have any concrete plans for the future.",null,null,B.i,!0,null)
B.Uh=new A.q("Venture capitalists aim to identify, fund, and profit from promising early-stage companies. They raise money from institutions and wealthy people, pool it into a fund, and invest in technology companies that they believe will become more valuable. If they turn out to be right, they take a cut of the returns\u2014usually 20%. A venture fund makes money when the companies in its portfolio become more valuable and either go public or get bought by larger companies. Venture funds usually have a 10-year lifespan since it takes time for successful companies to grow and \u201cexit.\u201d\n\nBut most venture-backed companies don\u2019t IPO or get acquired; most fail, usually soon after they start. Due to these early failures, a venture fund typically loses money at first. VCs hope the value of the fund will increase dramatically in a few years\u2019 time, to break-even and beyond, when the successful portfolio companies hit their exponential growth spurts and start to scale.\n\nThe big question is when this takeoff will happen. For most funds, the answer is never. Most startups fail, and most funds fail with them. Every VC knows that his task is to find the companies that will succeed. However, even seasoned investors understand this phenomenon only superficially. They know companies are different, but they underestimate the degree of difference.\n",null,null,B.i,!0,null)
B.Ui=new A.q("Most people act as if there were no secrets left to find. An extreme representative of this view is Ted Kaczynski, infamously known as the Unabomber. Kaczynski was a child prodigy who enrolled at Harvard at 16. He went on to get a PhD in math and become a professor at UC Berkeley. But you\u2019ve only ever heard of him because of the 17-year terror campaign he waged with pipe bombs against professors, technologists, and business people.\n\nIn late 1995, the authorities didn\u2019t know who or where the Unabomber was. The biggest clue was a 35,000-word manifesto that Kaczynski had written and anonymously mailed to the press. The FBI asked some prominent newspapers to publish it, hoping for a break in the case. It worked: Kaczynski\u2019s brother recognized his writing style and turned him in. You might expect that writing style to have shown obvious signs of insanity, but the manifesto is eerily cogent. Kaczynski claimed that in order to be happy, every individual \u201cneeds to have goals whose attainment requires effort, and needs to succeed in attaining at least some of his goals.\u201d He divided human goals into three groups:\n\n1. Goals that can be satisfied with minimal effort;\n2. Goals that can be satisfied with serious effort; and\n3. Goals that cannot be satisfied, no matter how much effort one makes.\n\nThis is the classic trichotomy of the easy, the hard, and the impossible. Kaczynski argued that modern people are depressed because all the world\u2019s hard problems have already been solved. What\u2019s left to do is either easy or impossible, and pursuing those tasks is deeply unsatisfying. What you can do, even a child can do; what you can\u2019t do, even Einstein couldn\u2019t have done. So Kaczynski\u2019s idea was to destroy existing institutions, get rid of all technology, and let people start over and work on hard problems anew.\n\nKaczynski\u2019s methods were crazy, but his loss of faith in the technological frontier is all around us. Consider the trivial but revealing hallmarks of urban hipsterdom: faux vintage photography, the handlebar mustache, and vinyl record players all hark back to an earlier time when people were still optimistic about the future. If everything worth doing has already been done, you may as well feign an allergy to achievement and become a barista.",null,null,B.i,!0,null)
B.Uj=new A.q("Cleantech entrepreneurs worked hard to convince themselves that their appointed hour had arrived. When he announced his new company in 2008, SpectraWatt CEO Andrew Wilson stated that \u201c[t]he solar industry is akin to where the microprocessor industry was in the late 1970s. There is a lot to be figured out and improved.\u201d The second part was right, but the microprocessor analogy was way off. Ever since the first microprocessor was built in 1970, computing advanced not just rapidly but exponentially. Look at Intel\u2019s early product release history:",null,null,B.i,!0,null)
B.Uk=new A.q("The 1990s had one big idea: the internet is going to be big. But too many internet companies had exactly that same idea and no others. An entrepreneur can\u2019t benefit from macro-scale insight unless his own plans begin at the micro-scale. Cleantech companies faced the same problem: no matter how much the world needs energy, only a firm that offers a superior solution for a specific energy problem can make money. No sector will ever be so important that merely participating in it will be enough to build a great company.\n\nThe tech bubble was far bigger than cleantech and the crash even more painful. But the dream of the \u201990s turned out to be right: skeptics who doubted that the internet would fundamentally change publishing or retail sales or everyday social life looked prescient in 2001, but they seem comically foolish today. Could successful energy startups be founded after the cleantech crash just as Web 2.0 startups successfully launched amid the debris of the dot-coms? The macro need for energy solutions is still real. But a valuable business must start by finding a niche and dominating a small market. Facebook started as a service for just one university campus before it spread to other schools and then the entire world. Finding small markets for energy solutions will be tricky\u2014you could aim to replace diesel as a power source for remote islands, or maybe build modular reactors for quick deployment at military installations in hostile territories. Paradoxically, the challenge for the entrepreneurs who will create Energy 2.0 is to think small.",null,null,B.i,!0,null)
B.Ul=new A.q("Unless you have perfectly conventional beliefs, it\u2019s rarely a good idea to tell everybody everything that you know.\n\nSo who do you tell? Whoever you need to, and no more. In practice, there\u2019s always a golden mean between telling nobody and telling everybody\u2014and that\u2019s a company. The best entrepreneurs know this: every great business is built around a secret that\u2019s hidden from the outside. A great company is a conspiracy to change the world; when you share your secret, the recipient becomes a fellow conspirator.\nAs Tolkien wrote in The Lord of the Rings:\n",null,null,B.i,!0,null)
B.Um=new A.q("While a definitely optimistic future would need engineers to design underwater  cities and settlements in space, an indefinitely optimistic future calls for more bankers and lawyers. Finance epitomizes indefinite thinking because it\u2019s the only way to make money when you have no idea how to create wealth. If they don\u2019t go to law school, bright college graduates head to Wall Street precisely because they have no real plan for their careers. And once they arrive at Goldman, they find that even inside finance, everything is indefinite. It\u2019s still optimistic\u2014you wouldn\u2019t play in the markets if you expected to lose\u2014but the fundamental tenet is that the market is random; you can\u2019t know anything specific or substantive; diversification becomes supremely important.\n\nThe indefiniteness of finance can be bizarre. Think about what happens when successful entrepreneurs sell their company. What do they do with the money? In a financialized world, it unfolds like this:\n\n\u2022 The founders don\u2019t know what to do with it, so they give it to a large bank.\n\u2022 The bankers don\u2019t know what to do with it, so they diversify by spreading it across a portfolio of institutional investors.\n\u2022 Institutional investors don\u2019t know what to do with their managed capital, so they diversify by amassing a portfolio of stocks.\n\u2022 Companies try to increase their share price by generating free cash flows. If they do, they issue dividends or buy back shares and the cycle repeats.\n\nAt no point does anyone in the chain know what to do with money in the real economy. But in an indefinite world, people actually prefer unlimited optionality; money is more valuable than anything you could possibly do with it. Only in a definite future is money a means to an end, not the end itself.\n\n",null,null,B.i,!0,null)
B.Un=new A.q("AS MATURE INDUSTRIES stagnate, information technology has advanced so rapidly that it has now become synonymous with \u201ctechnology\u201d itself. Today, more than 1.5 billion people enjoy instant access to the world\u2019s knowledge using pocket-sized devices. Every one of today\u2019s smartphones has thousands of times more processing power than the computers that guided astronauts to the moon. And if Moore\u2019s law continues apace, tomorrow\u2019s computers will be even more powerful.\n\nComputers already have enough power to outperform people in activities we used to think of as distinctively human. In 1997, IBM\u2019s Deep Blue defeated world chess champion Garry Kasparov. Jeopardy!\u2019s best-ever contestant, Ken Jennings, succumbed to IBM\u2019s Watson in 2011. And Google\u2019s self-driving cars are already on California roads today. Dale Earnhardt Jr. needn\u2019t feel threatened by them, but the Guardian worries (on behalf of the millions of chauffeurs and cabbies in the world) that self-driving cars \u201ccould drive the next wave of unemployment.\u201d\n\nEveryone expects computers to do more in the future\u2014so much more that some wonder: 30 years from now, will there be anything left for people to do? \u201cSoftware is eating the world,\u201d venture capitalist Marc Andreessen has announced with a tone of inevitability. VC Andy Kessler sounds almost gleeful when he explains that the best way to create productivity is \u201cto get rid of people.\u201d Forbes captured a more anxious attitude when it asked readers: Will a machine replace you?\n\nFuturists can seem like they hope the answer is yes. Luddites are so worried about being replaced that they would rather we stop building new technology altogether. Neither side questions the premise that better computers will necessarily replace human workers. But that premise is wrong: computers are complements for humans, not substitutes. The most valuable businesses of coming decades will be built by entrepreneurs who seek to empower people rather than try to make them obsolete.",null,null,B.i,!0,null)
B.Uo=new A.q("The problem with a competitive business goes beyond lack of profits. Imagine you\u2019re running one of those restaurants in Mountain View. You\u2019re not that different from dozens of your competitors, so you\u2019ve got to fight hard to survive. If you offer affordable food with low margins, you can probably pay employees only minimum wage. And you\u2019ll need to squeeze out every efficiency: that\u2019s why small restaurants put Grandma to work at the register and make the kids wash dishes in the back. Restaurants aren\u2019t much better even at the very highest rungs, where reviews and ratings like Michelin\u2019s star system enforce a culture of intense competition that can drive chefs crazy. (French chef and winner of three Michelin stars Bernard Loiseau was quoted as saying, \u201cIf I lose a star, I will commit suicide.\u201d Michelin maintained his rating, but Loiseau killed himself anyway in 2003 when a competing French dining guide downgraded his restaurant.) The competitive ecosystem pushes people toward ruthlessness or death.\n\nA monopoly like Google is different. Since it doesn\u2019t have to worry about competing with anyone, it has wider latitude to care about its workers, its products, and its impact on the wider world. Google\u2019s motto\u2014\u201cDon\u2019t be evil\u201d\u2014is in part a branding ploy, but it\u2019s also characteristic of a kind of business that\u2019s successful enough to take ethics seriously without jeopardizing its own existence. In business, money is either an important thing or it is everything. Monopolists can afford to think about things other than making money; non-monopolists can\u2019t. In perfect competition, a business is so focused on today\u2019s margins that it can\u2019t possibly plan for a long-term future. Only one thing can allow a business to transcend the daily brute struggle for survival: monopoly profits. ",null,null,B.i,!0,null)
B.Uq=new A.q("What does a company with large cash flows far into the future look like? Every monopoly is unique, but they usually share some combination of the following characteristics: proprietary technology, network effects, economies of scale, and branding.\n\nThis isn\u2019t a list of boxes to check as you build your business\u2014there\u2019s no shortcut to monopoly. However, analyzing your business according to these characteristics can help you think about how to make it durable.\n",null,null,B.i,!0,null)
B.Ur=new A.q("OUR CONTRARIAN QUESTION\u2014What important truth do very few people agree with you on?\u2014is difficult to answer directly. It may be easier to start with a preliminary: what does everybody agree on? \u201cMadness is rare in individuals\u2014but in groups, parties, nations, and ages it is the rule,\u201d Nietzsche wrote (before he went mad). If you can identify a delusional popular belief, you can find what lies hidden behind it: the contrarian truth.\n\nConsider an elementary proposition: companies exist to make money, not to lose it. This should be obvious to any thinking person. But it wasn\u2019t so obvious to many in the late 1990s, when no loss was too big to be described as an investment in an even bigger, brighter future. The conventional wisdom of the \u201cNew Economy\u201d accepted page views as a more authoritative, forward-looking financial metric than something as pedestrian as profit.\n\nConventional beliefs only ever come to appear arbitrary and wrong in retrospect whenever one collapses, we call the old belief a bubble. But the distortions caused by bubbles don\u2019t disappear when they pop. The internet craze of the \u201990s was the biggest bubble since the crash of 1929, and the lessons learned afterward define and distort almost all thinking about technology today. The first step to thinking clearly is to question what we think we know about the past. ",null,null,B.i,!0,null)
B.Us=new A.q("Most sales are not particularly complex: average deal sizes might range between $10,000 and $100,000, and usually the CEO won\u2019t have to do all the selling himself. The challenge here isn\u2019t about how to make any particular sale, but how to establish a process by which a sales team of modest size can move the product to a wide audience.\n\nIn 2008, Box had a good way for companies to store their data safely and accessibly in the cloud. But people didn\u2019t know they needed such a thing\u2014cloud computing hadn\u2019t caught on yet. That summer, Blake was hired as Box\u2019s third salesperson to help change that. Starting with small groups of users who had the most acute file sharing problems, Box\u2019s sales reps built relationships with more and more users in each client company. In 2009, Blake sold a small Box account to the Stanford Sleep Clinic, where researchers needed an easy, secure way to store experimental data logs. Today the university offers a Stanford-branded Box account to every one of its students and faculty members, and Stanford Hospital runs on Box. If it had started off by trying to sell the president of the university on an enterprise-wide solution, Box would have sold nothing. A complex sales approach would have made Box a forgotten startup failure; instead, personal sales made it a multibillion-dollar business.\n\nSometimes the product itself is a kind of distribution. ZocDoc is a Founders Fund portfolio company that helps people find and book medical appointments online. The company charges doctors a few hundred dollars per month to be included in its network. With an average deal size of just a few thousand dollars, ZocDoc needs lots of salespeople\u2014so many that they have an internal recruiting team to do nothing but hire more. But making personal sales to doctors doesn\u2019t just bring in revenue; by adding doctors to the network, salespeople make the product more valuable to consumers (and more consumer users increases its appeal to doctors). More than 5 million people already use the service each month, and if it can continue to scale its network to include a majority of practitioners, it will become a fundamental utility for the U.S. health care industry.",null,null,B.i,!0,null)
B.Ut=new A.q("Because globalization and technology are different modes of progress, it\u2019s possible to have both, either, or neither at the same time. For example, 1815 to 1914 was a period of both rapid technological development and rapid globalization. Between the First World War and Kissinger\u2019s trip to reopen relations with China in 1971, there was rapid technological development but not much globalization.\n\nSince 1971, we have seen rapid globalization along with limited technological development, mostly confined to IT.\n This age of globalization has made it easy to imagine that the decades ahead will bring more convergence and more sameness. Even our everyday language suggests we believe in a kind of technological end of history: the division of the world into the so-called developed and developing nations implies that the \u201cdeveloped\u201d world has already achieved the achievable, and that poorer nations just need to catch up. But I don\u2019t think that\u2019s true. My own answer to the contrarian question is that most people think the future of the world will be defined by globalization, but the truth is that technology matters more. Without technological change, if China doubles its energy production over the next two decades, it will also double its air pollution. If every one of India\u2019s hundreds of millions of households were to live the way Americans already do\u2014using only today\u2019s tools\u2014the result would be environmentally catastrophic. Spreading old ways to create wealth around the world will result in devastation, not riches. In a world of scarce resources, globalization  without new technology is unsustainable.\n\nNew technology has never been an automatic feature of history. Our ancestors lived in static, zero-sum societies where success meant seizing things from others. They created new sources of wealth only rarely, and in the long run they could never create enough to save the average person from an extremely hard life. Then, after 10,000 years of fitful advance from primitive agriculture to medieval windmills and 16th-century astrolabes, the modern world suddenly experienced relentless technological progress from the advent of the steam engine in the 1760s all the way up to about 1970. As a result, we have inherited a richer society than any previous generation would have been able to imagine.\n\nAny generation excepting our parents\u2019 and grandparents\u2019, that is: in the late 1960s, they expected this progress to continue. They looked forward to a four-day workweek, energy too cheap to meter, and vacations on the moon. But it didn\u2019t happen. The smartphones that distract us from our surroundings also distract us from the fact that our surroundings are strangely old: only computers and communications have improved dramatically since mid century. That doesn\u2019t mean our parents were wrong to imagine a better future\u2014they were only wrong to expect it as something automatic. Today our challenge is to both imagine and create the new technologies that can make the 21st century more peaceful and prosperous than the 20th. ",null,null,B.i,!0,null)
B.Uv=new A.q("   What does this contrarian question have to do with the future? In the most minimal sense, the future is simply the set of all moments yet to come. But what makes the future distinctive and important isn\u2019t that it hasn\u2019t happened yet, but     rather that it will be a time when the world looks different from today. In this sense,    if nothing about our society changes for the next 100 years, then the future is over 100 years away. If things change radically in the next decade, then the future is nearly at hand. No one can predict the future exactly, but we know two things: it\u2019s going to be different, and it must be rooted in today\u2019s world. Most answers to the contrarian question are different ways of seeing the present; good answers are as close as we can come to looking into the future.\n\n\n When we think about the future, we hope for a future of progress. That progress can take one of two forms. Horizontal or extensive progress means copying things that work\u2014going from 1 to n. Horizontal progress is easy to imagine because we already     know what it looks like. Vertical or intensive progress means doing new things\u2014  going from 0 to 1. Vertical progress is harder to imagine because it requires doing something nobody else has ever done. If you take one typewriter and build 100, you     have made horizontal progress. If you have a typewriter and build a word processor,    you have made vertical progress.\n",null,null,B.i,!0,null)
B.Uw=new A.q("Why did cleantech fail? Conservatives think they already know the answer: as soon as green energy became a priority for the government, it was poisoned. But there really were (and there still are) good reasons for making energy a priority. And the truth about cleantech is more complex and more important than government failure. Most cleantech companies crashed because they neglected one or more of the seven questions that every business must answer:\n\n1. The Engineering Question\nCan you create breakthrough technology instead of incremental improvements?\n\n2. The Timing Question\nIs now the right time to start your particular business?\n\n3. The Monopoly Question\nAre you starting with a big share of a small market?\n\n4. The People Question\nDo you have the right team?\n\n5. The Distribution Question\nDo you have a way to not just create but deliver your product?\n\n6. The Durability Question\nWill your market position be defensible 10 and 20 years into the future?\n\n7. The Secret Question\nHave you identified a unique opportunity that others don\u2019t see?\n\nWe\u2019ve discussed these elements before. Whatever your industry, any great business plan must address every one of them. If you don\u2019t have good answers to these questions, you\u2019ll run into lots of \u201cbad luck\u201d and your business will fail. If you nail all seven, you\u2019ll master fortune and succeed. Even getting five or six correct might work. But the striking thing about the cleantech bubble was that people were starting companies with zero good answers\u2014and that meant hoping for a miracle.\n\nIt\u2019s hard to know exactly why any particular cleantech company failed, since almost all of them made several serious mistakes. But since any one of those mistakes is enough to doom your company, it\u2019s worth reviewing cleantech\u2019s losing scorecard in more detail.",null,null,B.i,!0,null)
B.Uy=new A.q("Once you create and dominate a niche market, then you should gradually expand into related and slightly broader markets. Amazon shows how it can be done. Jeff Bezos\u2019s founding vision was to dominate all of online retail, but he very deliberately started with books. There were millions of books to catalog, but they all had roughly the same shape, they were easy to ship, and some of the most rarely sold books\u2014those least profitable for any retail store to keep in stock\u2014also drew the mostenthusiastic customers. Amazon became the dominant solution for anyone located far from a bookstore or seeking something unusual. Amazon then had two options: expand the number of people who read books, or expand to adjacent markets. They chose the latter, starting with the most similar markets: CDs, videos, and software. Amazon continued to add categories gradually until it had become the world\u2019s general store. The name itself brilliantly encapsulated the company\u2019s scaling strategy. The biodiversity of the Amazon rain forest reflected Amazon\u2019s first goal of cataloging every book in the world, and now it stands for every kind of thing in the world, period.\n\neBay also started by dominating small niche markets. When it launched its auction marketplace in 1995, it didn\u2019t need the whole world to adopt it at once; the product worked well for intense interest groups, like Beanie Baby obsessives. Once it monopolized the Beanie Baby trade, eBay didn\u2019t jump straight to listing sports cars or industrial surplus: it continued to cater to small-time hobbyists until it became the most reliable marketplace for people trading online no matter what the item.\n\nSometimes there are hidden obstacles to scaling\u2014a lesson that eBay has learned in recent years. Like all marketplaces, the auction marketplace lent itself to natural monopoly because buyers go where the sellers are and vice versa. But eBay found that the auction model works best for individually distinctive products like coins and stamps. It works less well for commodity products: people don\u2019t want to bid on pencils or Kleenex, so it\u2019s more convenient just to buy them from Amazon. eBay is still a valuable monopoly; it\u2019s just smaller than people in 2004 expected it to be.\n\nSequencing markets correctly is underrated, and it takes discipline to expand gradually. The most successful companies make the core progression\u2014to first dominate a specific niche and then scale to adjacent markets\u2014a part of their founding narrative.\n\n",null,null,B.i,!0,null)
B.Uz=new A.q("Professors downplay the cutthroat culture of academia, but managers never tire of comparing business to war. MBA students carry around copies of Clausewitz and Sun Tzu. War metaphors invade our everyday business language: we use headhunters to build up a sales force that will enable us to take a captive market and make a killing. But really it\u2019s competition, not business, that is like war: allegedly necessary, supposedly valiant, but ultimately destructive.\n\nWhy do people compete with each other? Marx and Shakespeare provide two models for understanding almost every kind of conflict. According to Marx, people fight because they are different. The proletariat fights the bourgeoisie because they have completely different ideas and goals (generated, for Marx, by their very different material circumstances). The greater the differences, the greater the conflict.\n\nTo Shakespeare, by contrast, all combatants look more or less alike. It\u2019s not at all clear why they should be fighting, since they have nothing to fight about. Consider the opening line from Romeo and Juliet: \u201cTwo households, both alike in dignity.\u201d The two houses are alike, yet they hate each other. They grow even more similar as the feud escalates. Eventually, they lose sight of why they started fighting in the first place.\n\nIn the world of business, at least, Shakespeare proves the superior guide. Inside a firm, people become obsessed with their competitors for career advancement. Then the firms themselves become obsessed with their competitors in the marketplace. Amid all the human drama, people lose sight of what matters and focus on their rivals instead.\n\nLet\u2019s test the Shakespearean model in the real world. Imagine a production called Gates and Schmidt, based on Romeo and Juliet. Montague is Microsoft. Capulet is Google. Two great families, run by alpha nerds, sure to clash on account of their sameness.\n\nAs with all good tragedy, the conflict seems inevitable only in retrospect. In fact it was entirely avoidable. These families came from very different places. The House of Montague built operating systems and office applications. The House of Capulet wrote a search engine. What was there to fight about? Lots, apparently. As a startup, each clan had been content to leave the other alone and prosper independently. But as they grew, they began to focus on each other. Montagues obsessed about Capulets obsessed about Montagues. The result? Windows vs. Chrome OS, Bing vs. Google Search, Explorer vs. Chrome, Office vs. Docs, and Surface vs. Nexus.\n\nJust as war cost the Montagues and Capulets their children, it cost Microsoft and Google their dominance: Apple came along and overtook them all. In January 2013, Apple\u2019s market capitalization was $500 billion, while Google and Microsoft combined were worth $467 billion. Just three years before, Microsoft and Google were each more valuable than Apple. War is costly business.\n\nRivalry causes us to overemphasize old opportunities and slavishly copy what has worked in the past. Consider the recent proliferation of mobile credit card readers. In October 2010, a startup called Square released a small, white, square-shaped product that let anyone with an iPhone swipe and accept credit cards. It was the first good payment processing solution for mobile handsets. Imitators promptly sprang into action. A Canadian company called NetSecure launched its own card reader in a half-moon shape. Intuit brought a cylindrical reader to the geometric battle. In March 2012, eBay\u2019s PayPal unit launched its own copycat card reader. It was shaped like a triangle\u2014a clear jab at Square, as three sides are simpler than four. One gets the sense that this Shakespearean saga won\u2019t end until the apes run out of shapes.\n",null,null,B.i,!0,null)
B.UA=new A.q("Nerds might wish that distribution could be ignored and salesmen banished to another planet. All of us want to believe that we make up our own minds, that sales doesn\u2019t work on us. But it\u2019s not true. Everybody has a product to sell\u2014no matter whether you\u2019re an employee, a founder, or an investor. It\u2019s true even if your company consists of just you and your computer. Look around. If you don\u2019t see any salespeople, you\u2019re the salesperson.",null,null,B.i,!0,null)
B.UB=new A.q("All fundamentalists think this way, not just terrorists and hipsters. Religious fundamentalism, for example, allows no middle ground for hard questions: there are easy truths that children are expected to rattle off, and then there are the mysteries of God, which can\u2019t be explained. In between\u2014the zone of hard truths\u2014lies heresy. In the modern religion of environmentalism, the easy truth is that we must protect the environment. Beyond that, Mother Nature knows best, and she cannot be questioned. Free marketeers worship a similar logic. The value of things is set by the market. Even a child can look up stock quotes. But whether those prices make sense is not to be second-guessed; the market knows far more than you ever could.\n\nWhy has so much of our society come to believe that there are no hard secrets left? It might start with geography. There are no blank spaces left on the map anymore. If you grew up in the 18th century, there were still new places to go. After hearing tales of foreign adventure, you could become an explorer yourself. This was probably true up through the 19th and early 20th centuries; after that point photography from National Geographic showed every Westerner what even the most exotic, underexplored places on earth look like. Today, explorers are found mostly in history books and children\u2019s tales. Parents don\u2019t expect their kids to become explorers any more than they expect them to become pirates or sultans. Perhaps there are a few dozen uncontacted tribes somewhere deep in the Amazon, and we know there remains one last earthly frontier in the depths of the oceans. But the unknown seems less accessible than ever.\n\nAlong with the natural fact that physical frontiers have receded, four social trends have conspired to root out belief in secrets. First is incrementalism. From an early age, we are taught that the right way to do things is to proceed one very small step at a time, day by day, grade by grade. If you overachieve and end up learning something that\u2019s not on the test, you won\u2019t receive credit for it. But in exchange for doing exactly what\u2019s asked of you (and for doing it just a bit better than your peers), you\u2019ll get an A. This process extends all the way up through the tenure track, which is why academics usually chase large numbers of trivial publications instead of new frontiers.\n\nSecond is risk aversion. People are scared of secrets because they are scared of being wrong. By definition, a secret hasn\u2019t been vetted by the mainstream. If your goal is to never make a mistake in your life, you shouldn\u2019t look for secrets. The prospect of being lonely but right\u2014dedicating your life to something that no one else believes in\u2014is already hard. The prospect of being lonely and wrong can be unbearable.\n\nThird is complacency. Social elites have the most freedom and ability to explore new thinking, but they seem to believe in secrets the least. Why search for a new secret if you can comfortably collect rents on everything that has already been done? Every fall, the deans at top law schools and business schools welcome the incoming class with the same implicit message: \u201cYou got into this elite institution. Your worries are over. You\u2019re set for life.\u201d But that\u2019s probably the kind of thing that\u2019s true only if you don\u2019t believe it.\n\nFourth is \u201cflatness.\u201d As globalization advances, people perceive the world as one homogeneous, highly competitive marketplace: the world is \u201cflat.\u201d Given that assumption, anyone who might have had the ambition to look for a secret will first ask himself: if it were possible to discover something new, wouldn\u2019t someone from the faceless global talent pool of smarter and more creative people have found it already? This voice of doubt can dissuade people from even starting to look for secrets in a world that seems too big a place for any individual to contribute something unique.\n\nThere\u2019s an optimistic way to describe the result of these trends: today, you can\u2019t start a cult. Forty years ago, people were more open to the idea that not all knowledge was widely known. From the Communist Party to the Hare Krishnas, large numbers of people thought they could join some enlightened vanguard that would show them the Way. Very few people take unorthodox ideas seriously today, and the mainstream sees that as a sign of progress. We can be glad that there are fewer crazy cults now, yet that gain has come at great cost: we have given up our sense of wonder at secrets left to be discovered.",null,null,B.i,!0,null)
B.UD=new A.q("Every culture has a myth of decline from some golden age, and almost all peoples throughout history have been pessimists. Even today pessimism still dominates huge parts of the world. An indefinite pessimist looks out onto a bleak future, but he has no idea what to do about it. This describes Europe since the early 1970s, when the continent succumbed to undirected bureaucratic drift. Today the whole Eurozone is in slow-motion crisis, and nobody is in charge. The European Central Bank doesn\u2019t stand for anything but improvisation: the U.S. Treasury prints \u201cIn God We Trust\u201d on the dollar; the ECB might as well print \u201cKick the Can Down the Road\u201d on the euro. Europeans just react to events as they happen and hope things don\u2019t get worse. The indefinite pessimist can\u2019t know whether the inevitable decline will be fast or slow, catastrophic or gradual. All he can do is wait for it to happen, so he might as well eat, drink, and be merry in the meantime: hence Europe\u2019s famous vacation mania.\n\n",null,null,B.i,!0,null)
B.UF=new A.q("Since so many founders seem to have extreme traits, you might guess that a plot showing only founders\u2019 traits would have fatter tails with more people at either end.",null,null,B.i,!0,null)
B.UG=new A.q("Our ancestors sought to understand and extend the human lifespan. In the 16thcentury, conquistadors searched the jungles of Florida for a Fountain of Youth.Francis Bacon wrote that \u201cthe prolongation of life\u201d should be considered its own branch of medicine\u2014and the noblest. In the 1660s, Robert Boyle placed life extension (along with \u201cthe Recovery of Youth\u201d) atop his famous wish list for the future of science. Whether through geographic exploration or laboratory research, the best minds of the Renaissance thought of death as something to defeat. (Some resisters were killed in action: Bacon caught pneumonia and died in 1626 while experimenting to see if he could extend a chicken\u2019s life by freezing it in the snow.)\n\nWe haven\u2019t yet uncovered the secrets of life, but insurers and statisticians in the 19th century successfully revealed a secret about death that still governs our thinking today: they discovered how to reduce it to a mathematical probability. \u201cLife tables\u201d tell us our chances of dying in any given year, something previous generations didn\u2019t know. However, in exchange for better insurance contracts, we seem to have given up the search for secrets about longevity. Systematic knowledge of the current range of human lifespans has made that range seem natural. Today our society is permeated by the twin ideas that death is both inevitable and random.\n\nMeanwhile, probabilistic attitudes have come to shape the agenda of biology itself. In 1928, Scottish scientist Alexander Fleming found that a mysterious antibacterial fungus had grown on a petri dish he\u2019d forgotten to cover in his laboratory: he discovered penicillin by accident. Scientists have sought to harness the power of chance ever since. Modern drug discovery aims to amplify Fleming\u2019s serendipitous circumstances a millionfold: pharmaceutical companies search through combinations of molecular compounds at random, hoping to find a hit.\n\nBut it\u2019s not working as well as it used to. Despite dramatic advances over the past two centuries, in recent decades biotechnology hasn\u2019t met the expectations of investors\u2014or patients. Eroom\u2019s law\u2014that\u2019s Moore\u2019s law backward\u2014observes that the number of new drugs approved per billion dollars spent on R&D has halved every nine years since 1950. Since information technology accelerated faster than ever during those same years, the big question for biotech today is whether it will ever see similar progress. Compare biotech startups to their counterparts in computer software: ",null,null,B.i,!0,null)
B.UH=new A.q("You can expect the future to take a definite form or you can treat it as hazily uncertain. If you treat the future as something definite, it makes sense to understand it in advance and to work to shape it. But if you expect an indefinite future ruled by randomness, you\u2019ll give up on trying to master it.\n\nIndefinite attitudes to the future explain what\u2019s most dysfunctional in our world today. Process trumps substance: when people lack concrete plans to carry out, they use formal rules to assemble a portfolio of various options. This describes Americans today. In middle school, we\u2019re encouraged to start hoarding \u201cextracurricular activities.\u201d In high school, ambitious students compete even harder to appear omnicompetent. By the time a student gets to college, he\u2019s spent a decade curating a bewilderingly diverse r\xe9sum\xe9 to prepare for a completely unknowable future. Come what may, he\u2019s ready\u2014for nothing in particular.\n\nA definite view, by contrast, favors firm convictions. Instead of pursuing many-sided mediocrity and calling it \u201cwell-roundedness,\u201d a definite person determines the one best thing to do and then does it. Instead of working tirelessly to make herself indistinguishable, she strives to be great at something substantive\u2014to be a monopoly of one. This is not what young people do today, because everyone around them has long since lost faith in a definite world. No one gets into Stanford by excelling at just one thing, unless that thing happens to involve throwing or catching a leather ball.\n",null,null,B.i,!0,null)
B.UM=new A.q("Of course, there are many things we don\u2019t yet understand, but some of those things may be impossible to figure out\u2014mysteries rather than secrets. For example, string theory describes the physics of the universe in terms of vibrating one-dimensional objects called \u201cstrings.\u201d Is string theory true? You can\u2019t really design experiments to test it. Very few people, if any, could ever understand all its implications. But is that just because it\u2019s difficult? Or is it an impossible mystery? The difference matters. You can achieve difficult things, but you can\u2019t achieve the impossible.\n\nRecall the business version of our contrarian question: what valuable company is nobody building? Every correct answer is necessarily a secret: something important and unknown, something hard to do but doable. If there are many secrets left in the world, there are probably many world-changing companies yet to be started. This chapter will help you think about secrets and how to find them.",null,null,B.i,!0,null)
B.UO=new A.q("Are all founders unusual people? Or do we just tend to remember and exaggerate whatever is most unusual about them? More important, which personal traits actually matter in a founder? This chapter is about why it\u2019s more powerful but at the same time more dangerous for a company to be led by a distinctive individual instead of an interchangeable manager.",null,null,B.i,!0,null)
B.UQ=new A.q("Every entrepreneur should plan to be the last mover in her particular market. That starts with asking yourself: what will the world look like 10 and 20 years from now, and how will my business fit in?\n\nFew cleantech companies had a good answer. As a result, all their obituaries resemble each other. A few months before it filed for bankruptcy in 2011, Evergreen Solar explained its decision to close one of its U.S. factories:\n\n   Solar manufacturers in China have received considerable government and financial support.... Although [our] production costs ... are now below originally planned levels and lower than most western manufacturers, they are still much higher than those of our low cost competitors in China.       \n\nBut it wasn\u2019t until 2012 that the \u201cblame China\u201d chorus really exploded. Discussing its bankruptcy filing, U.S. Department of Energy\u2013backed Abound Solar blamed \u201caggressive pricing actions from Chinese solar panel companies\u201d that \u201cmade it very difficult for an early stage startup company ... to scale in current market conditions.\u201d When solar panel maker Energy Conversion Devices failed in February 2012, it went beyond blaming China in a press release and filed a $950 million lawsuit against three prominent Chinese solar manufacturers\u2014the same companies that Solyndra\u2019s trustees in bankruptcy sued later that year on the grounds of attempted monopolization, conspiracy, and predatory pricing. But was competition from Chinese manufacturers really impossible to predict? Cleantech entrepreneurs would have done well to rephrase the durability question and ask: what will stop China from wiping out my business? Without an answer, the result shouldn\u2019t have come as a surprise.\n\nBeyond the failure to anticipate competition in manufacturing the same green products, cleantech embraced misguided assumptions about the energy market as a whole. An industry premised on the supposed twilight of fossil fuels was blindsided by the rise of fracking. In 2000, just 1.7% of America\u2019s natural gas came from fracked shale. Five years later, that figure had climbed to 4.1%. Nevertheless, nobody in cleantech took this trend seriously: renewables were the only way forward; fossil fuels couldn\u2019t possibly get cheaper or cleaner in the future. But they did. By 2013, shale gas accounted for 34% of America\u2019s natural gas, and gas prices had fallen more than 70% since 2008, devastating most renewable energy business models. Fracking may not be a durable energy solution, either, but it was enough to doom cleantech companies that didn\u2019t see it coming.",null,null,B.i,!0,null)
B.UR=new A.q("Cleantech entrepreneurs aimed for more than just success as most businesses define it. The cleantech bubble was the biggest phenomenon\u2014and the biggest flop\u2014in the history of \u201csocial entrepreneurship.\u201d This philanthropic approach to business starts with the idea that corporations and nonprofits have until now been polar opposites: corporations have great power, but they\u2019re shackled to the profit motive; nonprofits pursue the public interest, but they\u2019re weak players in the wider economy. Social entrepreneurs aim to combine the best of both worlds and \u201cdo well by doing good.\u201d Usually they end up doing neither.\n\nThe ambiguity between social and financial goals doesn\u2019t help. But the ambiguity in the word \u201csocial\u201d is even more of a problem: if something is \u201csocially good,\u201d is it good for society, or merely seen as good by society? Whatever is good enough to receive applause from all audiences can only be conventional, like the general idea of green energy.\n\nProgress isn\u2019t held back by some difference between corporate greed and nonprofit goodness; instead, we\u2019re held back by the sameness of both. Just as corporations tend to copy each other, nonprofits all tend to push the same priorities. Cleantech shows the result: hundreds of undifferentiated products all in the name of one overbroad goal.\n\nDoing something dif erent is what\u2019s truly good for society\u2014and it\u2019s also what allows a business to profit by monopolizing a new market. The best projects are likely to be overlooked, not trumpeted by a crowd; the best problems to work on are often the ones nobody else even tries to solve.",null,null,B.i,!0,null)
B.UU=new A.q("The U.S. advertising industry collects annual revenues of $150 billion and employs more than 600,000 people. At $450 billion annually, the U.S. sales industry is even bigger. When they hear that 3.2 million Americans work in sales, seasoned executives will suspect the number is low, but engineers may sigh in bewilderment. What could that many salespeople possibly be doing?\n\nIn Silicon Valley, nerds are skeptical of advertising, marketing, and sales because they seem superficial and irrational. But advertising matters because it works. It works on nerds, and it works on you. You may think that you\u2019re an exception; that your preferences are authentic, and advertising only works on other people. It\u2019s easy to resist the most obvious sales pitches, so we entertain a false confidence in our own independence of mind. But advertising doesn\u2019t exist to make you buy a product right away; it exists to embed subtle impressions that will drive sales later. Anyone who can\u2019t acknowledge its likely effect on himself is doubly deceived.\n\nNerds are used to transparency. They add value by becoming expert at a technical skill like computer programming. In engineering disciplines, a solution either works or it fails. You can evaluate someone else\u2019s work with relative ease, as surface appearances don\u2019t matter much. Sales is the opposite: an orchestrated campaign to change surface appearances without changing the underlying reality. This strikes engineers as trivial if not fundamentally dishonest. They know their own jobs are hard, so when they look at salespeople laughing on the phone with a customer or going to two-hour lunches, they suspect that no real work is being done. If anything, people overestimate the relative difficulty of science and engineering, because the challenges of those fields are obvious. What nerds miss is that it takes hard work to make sales look easy.",null,null,B.i,!0,null)
B.UV=new A.q("THE BUSINESS VERSION of our contrarian question is: what valuable company is nobody building? This question is harder than it looks, because your company could create a lot of value without becoming very valuable itself. Creating value is not enough\u2014you also need to capture some of the value you create.\n\nThis means that even very big businesses can be bad businesses. For example, U.S. airline companies serve millions of passengers and create hundreds of billions of dollars of value each year. But in 2012, when the average airfare each way was $178, the airlines made only 37 cents per passenger trip. Compare them to Google, which creates less value but captures far more. Google brought in $50 billion in 2012 (versus $160 billion for the airlines), but it kept 21% of those revenues as profits\u2014 more than 100 times the airline industry\u2019s profit margin that year. Google makes so much money that it\u2019s now worth three times more than every U.S. airline combined.\n\nThe airlines compete with each other, but Google stands alone. Economists use two simplified models to explain the difference: perfect competition and monopoly. \u201cPerfect competition\u201d is considered both the ideal and the default state in Economics 101. So-called perfectly competitive markets achieve equilibrium when producer supply meets consumer demand. Every firm in a competitive market is undifferentiated and sells the same homogeneous products. Since no firm has any market power, they must all sell at whatever price the market determines. If there is money to be made, new firms will enter the market, increase supply, drive prices down, and thereby eliminate the profits that attracted them in the first place. If too many firms enter the market, they\u2019ll suffer losses, some will fold, and prices will rise back to sustainable levels. Under perfect competition, in the long run no company makes an economic profit.\n\nThe opposite of perfect competition is monopoly. Whereas a competitive firm must sell at the market price, a monopoly owns its market, so it can set its own prices. Since it has no competition, it produces at the quantity and price combination that maximizes its profits.\n\nTo an economist, every monopoly looks the same, whether it deviously eliminates rivals, secures a license from the state, or innovates its way to the top. In this book, we\u2019re not interested in illegal bullies or government favorites: by \u201cmonopoly,\u201d we mean the kind of company that\u2019s so good at what it does that no other firm can offer a close substitute. Google is a good example of a company that went from 0 to 1: it hasn\u2019t competed in search since the early 2000s, when it definitively distanced itself from Microsoft and Yahoo!\n\nAmericans mythologize competition and credit it with saving us from socialist bread lines. Actually, capitalism and competition are opposites. Capitalism is premised on the accumulation of capital, but under perfect competition all profits get competed away. The lesson for entrepreneurs is clear: if you want to create and capture lasting value, don\u2019t build an undifferentiated commodity business. ",null,null,B.i,!0,null)
B.UW=new A.q("The first silicon solar cell, by contrast, was created by Bell Labs in 1954\u2014more than a half century before Wilson\u2019s press release. Photovoltaic efficiency improved in the intervening decades, but slowly and linearly: Bell\u2019s first solar cell had about 6% efficiency; neither today\u2019s crystalline silicon cells nor modern thin-film cells have exceeded 25% efficiency in the field. There were few engineering developments in the mid-2000s to suggest impending liftoff. Entering a slow-moving market can be a good strategy, but only if you have a definite and realistic plan to take it over. The failed cleantech companies had none.",null,null,B.i,!0,null)
B.UX=new A.q("MONEY MAKES MONEY. \u201cFor whoever has will be given more, and they will have an abundance. Whoever does not have, even what they have will be taken from them\u201d (Matthew 25:29). Albert Einstein made the same observation when he stated that compound interest was \u201cthe eighth wonder of the world,\u201d \u201cthe greatest mathematical discovery of all time,\u201d or even \u201cthe most powerful force in the universe.\u201d Whichever version you prefer, you can\u2019t miss his message: never underestimate exponential growth. Actually, there\u2019s no evidence that Einstein evern said any of those things\u2014the quotations are all apocryphal. But this very misattribution reinforces the message: having invested the principal of a lifetime\u2019s brilliance, Einstein continues to earn interest on it from beyond the grave by receiving credit for things he never said.\n\nMost sayings are forgotten. At the other extreme, a select few people like Einstein and Shakespeare are constantly quoted and ventriloquized. We shouldn\u2019t be surprised, since small minorities often achieve disproportionate results. In 1906, economist Vilfredo Pareto discovered what became the \u201cPareto principle,\u201d or the 80-20 rule, when he noticed that 20% of the people owned 80% of the land in Italy\u2014a phenomenon that he found just as natural as the fact that 20% of the peapods in his garden produced 80% of the peas. This extraordinarily stark pattern, in which a small few radically outstrip all rivals, surrounds us everywhere in the natural and social world. The most destructive earthquakes are many times more powerful than all smaller earthquakes combined. The biggest cities dwarf all mere towns put together. And monopoly businesses capture more value than millions of undifferentiated competitors. Whatever Einstein did or didn\u2019t say, the power law\u2014so named because exponential equations describe severely unequal distributions\u2014is the law of the universe. It defines our surroundings so completely that we usually don\u2019t even see it.\n\nThis chapter shows how the power law becomes visible when you follow the money: in venture capital, where investors try to profit from exponential growth in early-stage companies, a few companies attain exponentially greater value than all others. Most businesses never need to deal with venture capital, but everyone needs to know exactly one thing that even venture capitalists struggle to understand: we  don\u2019t live in a normal world; we live under a power law.",null,null,B.i,!0,null)
B.UY=new A.q("The most famous people in the world are founders, too: instead of a company, every celebrity founds and cultivates a personal brand. Lady Gaga, for example, became one of the most influential living people. But is she even a real person? Her real name isn\u2019t a secret, but almost no one knows or cares what it is. She wears costumes so bizarre as to put any other wearer at risk of an involuntary psychiatric hold. Gaga would have you believe that she was \u201cborn this way\u201d\u2014the title of both her second album and its lead track. But no one is born looking like a zombie with horns coming out of her head: Gaga must therefore be a self-manufactured myth. Then again, what kind of person would do this to herself? Certainly nobody normal. So perhaps Gaga really was born that way.",null,null,B.i,!0,null)
B.V1=new A.q("Some people are strong, some are weak, some are geniuses, some are dullards\u2014butmost people are in the middle. Plot where everyone falls and you\u2019ll see a bell curve:",null,null,B.i,!0,null)
B.V2=new A.q("A company has a monopoly on its own brand by definition, so creating a strong brand is a powerful way to claim a monopoly. Today\u2019s strongest tech brand is Apple: the attractive looks and carefully chosen materials of products like the iPhone and MacBook, the Apple Stores\u2019 sleek minimalist design and close control over the consumer experience, the omnipresent advertising campaigns, the price positioning as a maker of premium goods, and the lingering nimbus of Steve Jobs\u2019s personal charisma all contribute to a perception that Apple offers products so good as to constitute a category of their own.\n\nMany have tried to learn from Apple\u2019s success: paid advertising, branded stores, luxurious materials, playful keynote speeches, high prices, and even minimalist design are all susceptible to imitation. But these techniques for polishing the surface don\u2019t work without a strong underlying substance. Apple has a complex suite of proprietary technologies, both in hardware (like superior touchscreen materials) and software (like touchscreen interfaces purpose-designed for specific materials). It manufactures products at a scale large enough to dominate pricing for the materials it buys. And it enjoys strong network effects from its content ecosystem: thousands of developers write software for Apple devices because that\u2019s where hundreds of millions of users are, and those users stay on the platform because it\u2019s where the apps are. These other monopolistic advantages are less obvious than Apple\u2019s sparkling brand, but they are the fundamentals that let the branding effectively reinforce Apple\u2019s monopoly.\n\nBeginning with brand rather than substance is dangerous. Ever since Marissa Mayer became CEO of Yahoo! in mid-2012, she has worked to revive the once-popular internet giant by making it cool again. In a single tweet, Yahoo! summarized Mayer\u2019s plan as a chain reaction of \u201cpeople then products then traffic then revenue.\u201d The people are supposed to come for the coolness: Yahoo! demonstrated design awareness by overhauling its logo, it asserted youthful relevance by acquiring hot startups like Tumblr, and it has gained media attention for Mayer\u2019s own star power. But the big question is what products Yahoo! will actually create. When Steve Jobs returned to Apple, he didn\u2019t just make Apple a cool place to work; he slashed product lines to focus on the handful of opportunities for 10x improvements. No technology company can be built on branding alone.",null,null,B.i,!0,null)
