B.V6=new A.q("But that doesn\u2019t capture the strangest thing about founders. Normally we expect opposite traits to be mutually exclusive: a normal person can\u2019t be both rich and poor at the same time, for instance. But it happens all the time to founders: startup CEOs can be cash poor but millionaires on paper. They may oscillate between sullen jerkiness and appealing charisma. Almost all successful entrepreneurs are simultaneously insiders and outsiders. And when they do succeed, they attract both fame and infamy. When you plot them out, founders\u2019 traits appear to follow an inverse normal distribution: ",null,null,B.i,!0,null)
B.V7=new A.q("The Road goes ever on and on\nDown from the door where it began.\n",null,B.jR,B.i,!0,null)
B.V9=new A.q("Whenever I Interview someone for a job, I like to ask this question: \u201cWhat important truth do very few people agree with you on?\u201d This question sounds easy because it\u2019s straightforward. Actually, it\u2019s very hard to answer. It\u2019s intellectually difficult because the knowledge that everyone is taught in school is by definition agreed upon. And it\u2019s psychologically difficult because anyone trying to answer must say something she knows to be unpopular. Brilliant thinking     is rare, but courage is in even shorter supply than genius.\n\nMost commonly, I hear answers like the following:\n\u201cOur educational system is broken and urgently needs to be fixed.\u201d\n\u201cAmerica is exceptional.\u201d\n\u201cThere is no God.\u201d\n",null,null,B.i,!0,null)
B.Vb=new A.q("Energy problems are engineering problems, so you would expect to find nerds running cleantech companies. You\u2019d be wrong: the ones that failed were run by shockingly nontechnical teams. These salesman-executives were good at raising capital and securing government subsidies, but they were less good at building products that customers wanted to buy.\nAt Founders Fund, we saw this coming. The most obvious clue was sartorial: cleantech executives were running around wearing suits and ties. This was a huge red flag, because real technologists wear T-shirts and jeans. So we instituted a blanket rule: pass on any company whose founders dressed up for pitch meetings. Maybe we still would have avoided these bad investments if we had taken the time to evaluate each company\u2019s technology in detail. But the team insight\u2014never invest in a tech CEO that wears a suit\u2014got us to the truth a lot faster. The best sales is hidden. There\u2019s nothing wrong with a CEO who can sell, but if he actually looks like a salesman, he\u2019s probably bad at sales and worse at tech.",null,null,B.i,!0,null)
B.Vc=new A.q("Which of the four will it be? Recurrent collapse seems unlikely: the knowledge underlying civilization is so widespread today that complete annihilation would be more probable than a long period of darkness followed by recovery. However, in case of extinction, there is no human future of any kind to consider.\n\nIf we define the future as a time that looks different from the present, then most people aren\u2019t expecting any future at all; instead, they expect coming decades to bring more globalization, convergence, and sameness. In this scenario, poorer countries will catch up to richer countries, and the world as a whole will reach an economic plateau. But even if a truly globalized plateau were possible, could it last? In the best case, economic competition would be more intense than ever before for every single person and firm on the planet.\n\nHowever, when you add competition to consume scarce resources, it\u2019s hard to see how a global plateau could last indefinitely. Without new technology to relieve competitive pressures, stagnation is likely to erupt into conflict. In case of conflict on a global scale, stagnation collapses into extinction.\n\nThat leaves the fourth scenario, in which we create new technology to make a much better future. The most dramatic version of this outcome is called the Singularity, an attempt to name the imagined result of new technologies so powerful as to transcend the current limits of our understanding. Ray Kurzweil, the best-known Singularitarian, starts from Moore\u2019s law and traces exponential growth trends in dozens of fields, confidently projecting a future of superhuman artificial intelligence. According to Kurzweil, \u201cthe Singularity is near,\u201d it\u2019s inevitable, and all we have to do is prepare ourselves to accept it.\n\nBut no matter how many trends can be traced, the future won\u2019t happen on its own. What the Singularity would look like matters less than the stark choice we face  today between the two most likely scenarios: nothing or something. It\u2019s up to us. We cannot take for granted that the future will be better, and that means we need to work to create it today.\n\nWhether we achieve the Singularity on a cosmic scale is perhaps less important than whether we seize the unique opportunities we have to do new things in our own working lives. Everything important to us\u2014the universe, the planet, the country, your company, your life, and this very moment\u2014is singular.\n\nOur task today is to find singular ways to create the new things that will make the future not just different, but better\u2014to go from 0 to 1. The essential first step is to think for yourself. Only by seeing our world anew, as fresh and strange as it was to the ancients who saw it first, can we both re-create it and preserve it for the future.",null,null,B.i,!0,null)
B.Ve=new A.q("A great technology company should have proprietary technology an order of magnitude better than its nearest substitute. But cleantech companies rarely produced 2x, let alone 10x, improvements. Sometimes their offerings were actually worse than the products they sought to replace. Solyndra developed novel, cylindrical solar cells, but to a first approximation, cylindrical cells are only 1/\u03c0 as efficient as flat ones\u2014they simply don\u2019t receive as much direct sunlight. The company tried to correct for this deficiency by using mirrors to reflect more sunlight to hit the bottoms of the panels, but it\u2019s hard to recover from a radically inferior starting point.\n\nCompanies must strive for 10x better because merely incremental improvements often end up meaning no improvement at all for the end user. Suppose you develop a new wind turbine that\u2019s 20% more efficient than any existing technology\u2014when you test it in the laboratory. That sounds good at first, but the lab result won\u2019t begin to compensate for the expenses and risks faced by any new product in the real world. And even if your system really is 20% better on net for the customer who buys it, people are so used to exaggerated claims that you\u2019ll be met with skepticism when you try to sell it. Only when your product is 10x better can you offer the customer transparent superiority.",null,null,B.i,!0,null)
