B.Vj=new A.q("Politicians have always been officially accountable to the public at election time, but today they are attuned to what the public thinks at every moment. Modern polling enables politicians to tailor their image to match preexisting public opinion exactly, so for the most part, they do. Nate Silver\u2019s election predictions are remarkably accurate, but even more remarkable is how big a story they become every four years. We are more fascinated today by statistical predictions of what the country will be thinking in a few weeks\u2019 time than by visionary predictions of what the country will look like 10 or 20 years from now.\n\nAnd it\u2019s not just the electoral process\u2014the very character of government has become indefinite, too. The government used to be able to coordinate complex solutions to problems like atomic weaponry and lunar exploration. But today, after 40 years of indefinite creep, the government mainly just provides insurance; our solutions to big problems are Medicare, Social Security, and a dizzying array of other transfer payment programs. It\u2019s no surprise that entitlement spending has eclipsed discretionary spending every year since 1975. To increase discretionary spending we\u2019d need definite plans to solve specific problems. But according to the indefinite logic of entitlement spending, we can make things better just by sending out more checks.\n\n",null,null,B.i,!0,null)
B.Vl=new A.q("A product is viral if its core functionality encourages users to invite their friends to become users too. This is how Facebook and PayPal both grew quickly: every time someone shares with a friend or makes a payment, they naturally invite more and more people into the network. This isn\u2019t just cheap\u2014it\u2019s fast, too. If every new user leads to more than one additional user, you can achieve a chain reaction of exponential growth. The ideal viral loop should be as quick and frictionless as possible. Funny YouTube videos or internet memes get millions of views very quickly because they have extremely short cycle times: people see the kitten, feel warm inside, and forward it to their friends in a matter of seconds.\n\nAt PayPal, our initial user base was 24 people, all of whom worked at PayPal. Acquiring customers through banner advertising proved too expensive. However, by directly paying people to sign up and then paying them more to refer friends, we achieved extraordinary growth. This strategy cost us $20 per customer, but it also led to 7% daily growth, which meant that our user base nearly doubled every 10 days. After four or five months, we had hundreds of thousands of users and a viable opportunity to build a great company by servicing money transfers for small fees that ended up greatly exceeding our customer acquisition cost.\n\nWhoever is first to dominate the most important segment of a market with viral potential will be the last mover in the whole market. At PayPal we didn\u2019t want to acquire more users at random; we wanted to get the most valuable users first. The most obvious market segment in email-based payments was the millions of emigrants still using Western Union to wire money to their families back home. Our product made that effortless, but the transactions were too infrequent. We needed a smaller niche market segment with a higher velocity of money\u2014a segment we found in eBay \u201cPowerSellers,\u201d the professional vendors who sold goods online through eBay\u2019s auction marketplace. There were 20,000 of them. Most had multiple auctions ending each day, and they bought almost as much as they sold, which meant a constant stream of payments. And because eBay\u2019s own solution to the payment problem was terrible, these merchants were extremely enthusiastic early adopters. Once PayPal dominated this segment and became the payments platform for eBay, there was no catching up\u2014on eBay or anywhere else.",null,null,B.i,!0,null)
B.Vn=new A.q("Every startup is small at the start. Every monopoly dominates a large share of its market. Therefore, every startup should start with a very small market. Always err on the side of starting too small. The reason is simple: it\u2019s easier to dominate a small market than a large one. If you think your initial market might be too big, it almost certainly is.\n\nSmall doesn\u2019t mean nonexistent. We made this mistake early on at PayPal. Our first product let people beam money to each other via PalmPilots. It was interesting technology and no one else was doing it. However, the world\u2019s millions of PalmPilot users weren\u2019t concentrated in a particular place, they had little in common, and they used their devices only episodically. Nobody needed our product, so we had no customers.\n\nWith that lesson learned, we set our sights on eBay auctions, where we found our first success. In late 1999, eBay had a few thousand high-volume \u201cPowerSellers,\u201d and after only three months of dedicated effort, we were serving 25% of them. It was much easier to reach a few thousand people who really needed our product than to try to compete for the attention of millions of scattered individuals.\n\nThe perfect target market for a startup is a small group of particular people concentrated together and served by few or no competitors. Any big market is a bad choice, and a big market already served by competing companies is even worse. This is why it\u2019s always a red flag when entrepreneurs talk about getting 1% of a $100 billion market. In practice, a large market will either lack a good starting point or it will be open to competition, so it\u2019s hard to ever reach that 1%. And even if you do succeed in gaining a small foothold, you\u2019ll have to be satisfied with keeping the lights on: cutthroat competition means your profits will be zero.\n\n",null,null,B.i,!0,null)
B.Vq=new A.q("\nAfter a brief pessimistic phase in the 1970s, indefinite optimism has dominated American thinking ever since 1982, when a long bull market began and finance eclipsed engineering as the way to approach the future. To an indefinite optimist, the future will be better, but he doesn\u2019t know how exactly, so he won\u2019t make any specific plans. He expects to profit from the future but sees no reason to design it concretely. Instead of working for years to build a new product, indefinite optimists rearrange already-invented ones. Bankers make money by rearranging the capital structures of already existing companies. Lawyers resolve disputes over old things or help other people structure their affairs. And private equity investors and management consultants don\u2019t start new businesses; they squeeze extra efficiency from old ones with incessant procedural optimizations. It\u2019s no surprise that these fields all attract disproportionate numbers of high-achieving Ivy League optionality chasers; what could be a more appropriate reward for two decades of r\xe9sum\xe9-building than a seemingly elite, process-oriented career that promises to \u201ckeep options open\u201d?\n\nRecent graduates\u2019 parents often cheer them on the established path. The strange history of the Baby Boom produced a generation of indefinite optimists so used to effortless progress that they feel entitled to it. Whether you were born in 1945 or 1950 or 1955, things got better every year for the first 18 years of your life, and it had nothing to do with you. Technological advance seemed to accelerate automatically, so the Boomers grew up with great expectations but few specific plans for how to fulfill them. Then, when technological progress stalled in the 1970s, increasing income inequality came to the rescue of the most elite Boomers. Every year of adulthood continued to get automatically better and better for the rich and successful. The rest of their generation was left behind, but the wealthy Boomers who shape public opinion today see little reason to question their na\xefve optimism. Since tracked careers worked for them, they can\u2019t imagine that they won\u2019t work for their kids, too.\n\nMalcolm Gladwell says you can\u2019t understand Bill Gates\u2019s success without understanding his fortunate personal context: he grew up in a good family, went to a private school equipped with a computer lab, and counted Paul Allen as a childhood friend. But perhaps you can\u2019t understand Malcolm Gladwell without understanding his historical context as a Boomer (born in 1963). When Baby Boomers grow up and write books to explain why one or another individual is successful, they point to the power of a particular individual\u2019s context as determined by chance. But they miss the even bigger social context for their own preferred explanations: a whole generation learned from childhood to overrate the power of chance and underrate the importance of planning. Gladwell at first appears to be making a contrarian critique of the myth of the self-made businessman, but actually his own account encapsulates the conventional view of a generation.",null,null,B.i,!0,null)
B.Vr=new A.q("Fifteen years ago, American workers were worried about competition from cheaperMexican substitutes. And that made sense, because humans really can substitute foreach other. Today people think they can hear Ross Perot\u2019s \u201cgiant sucking sound\u201donce more, but they trace it back to server farms somewhere in Texas instead of cut-rate factories in Tijuana. Americans fear technology in the near future because theysee it as a replay of the globalization of the near past. But the situations are verydifferent: people compete for jobs and for resources; computers compete for neither.",null,null,B.i,!0,null)
B.Vu=new A.q("The last of the four possibilities is the hardest one to imagine: accelerating takeoff toward a much better future. The end result of such a breakthrough could take a number of forms, but any one of them would be so different from the present as to defy description.",null,null,B.i,!0,null)
B.Vv=new A.q("Contents",null,null,null,null,null)
B.Vx=new A.q("\nAs an example, take Sir Richard Branson, the billionaire founder of the Virgin Group. He could be described as a natural entrepreneur: Branson started his first business at age 16, and at just 22 he founded Virgin Records. But other aspects of his renown\u2014the trademark lion\u2019s mane hairstyle, for example\u2014are less natural: one suspects he wasn\u2019t born with that exact look. As Branson has cultivated his other extreme traits (Is kiteboarding with naked supermodels a PR stunt? Just a guy having fun? Both?), the media has eagerly enthroned him: Branson is \u201cThe Virgin King,\u201d \u201cThe Undisputed King of PR,\u201d \u201cThe King of Branding,\u201d and \u201cThe King of the Desert and Space.\u201d When Virgin Atlantic Airways began serving passengers drinks with ice cubes shaped like Branson\u2019s face, he became \u201cThe Ice King.\u201d Is Branson just a normal businessman who happens to be lionized by the media with the help of a good PR team? Or is he himself a born branding genius rightly singled out by the journalists he is so good at manipulating? It\u2019s hard to tell\u2014maybe he\u2019s both.",null,null,B.i,!0,null)
B.Vz=new A.q("\nThe entrepreneurs who stuck with Silicon Valley learned four big lessons from the  dot-com crash that still guide business thinking today:\n\n1. Make incremental advances\nGrand visions inflated the bubble, so they should not be indulged. Anyone who claims to be able to do something great is suspect, and anyone who wants to change the world should be more humble. Small, incremental steps are the only safe path forward.\n\n2. Stay lean and flexible\nAll companies must be \u201clean,\u201d which is code for \u201cunplanned.\u201d You should not know what your business will do; planning is arrogant and inflexible. Instead you should try things out, \u201citerate,\u201d and treat entrepreneurship as agnostic experimentation.\n\n3. Improve on the competition\nDon\u2019t try to create a new market prematurely. The only way to know you have a real business is to start with an already existing customer, so you should build your company by improving on recognizable products already offered by successful competitors.\n\n4. Focus on product, not sales\nIf your product requires advertising or salespeople to sell it, it\u2019s not good enough: technology is primarily about product development, not distribution. Bubble-era advertising was obviously wasteful, so the only sustainable growth is viral growth.\n\nThese lessons have become dogma in the startup world; those who would ignore them are presumed to invite the justified doom visited upon technology in the great crash of 2000. And yet the opposite principles are probably more correct:\n\n1. It is better to risk boldness than triviality.\n2. A bad plan is better than no plan.\n3. Competitive markets destroy profits.\n4. Sales matters just as much as product.\n\nIt\u2019s true that there was a bubble in technology. The late \u201990s was a time of hubris: people believed in going from 0 to 1. Too few startups were actually getting there, and many never went beyond talking about it. But people understood that we had no choice but to find ways to do more with less. The market high of March 2000 was obviously a peak of insanity; less obvious but more important, it was also a peak of clarity. People looked far into the future, saw how much valuable new technology we would need to get there safely, and judged themselves capable of creating it.\n\nWe still need new technology, and we may even need some 1999-style hubris and exuberance to get it. To build the next generation of companies, we must abandon the dogmas created after the crash. That doesn\u2019t mean the opposite ideas are automatically true: you can\u2019t escape the madness of crowds by dogmatically rejecting them. Instead ask yourself: how much of what you know about business is shaped by mistaken reactions to past mistakes? The most contrarian thing of all is not to oppose the crowd but to think for yourself. ",null,null,B.i,!0,null)
B.VA=new A.q("Key Insights from the Book",null,B.xB,B.E,null,null)
B.VB=new A.q("The stark differences between man and machine mean that gains from workingwith computers are much higher than gains from trade with other people. We don\u2019ttrade with computers any more than we trade with livestock or lamps. And that\u2019s thepoint: computers are tools, not rivals.\n\nThe differences are even deeper on the demand side. Unlike people inindustrializing countries, computers don\u2019t yearn for more luxurious foods orbeachfront villas in Cap Ferrat; all they require is a nominal amount of electricity,which they\u2019re not even smart enough to want. When we design new computertechnology to help solve problems, we get all the efficiency gains of ahyperspecialized trading partner without having to compete with it for resources.Properly understood, technology is the one way for us to escape competition in aglobalizing world. As computers become more and more powerful, they won\u2019t besubstitutes for humans: they\u2019ll be complements.",null,null,B.i,!0,null)
B.VC=new A.q("From the outside, everyone in your company should be dif erent in the same way.\nUnlike people on the East Coast, who all wear the same skinny jeans or pinstripe suits depending on their industry, young people in Mountain View and Palo Alto go to work wearing T-shirts. It\u2019s a clich\xe9 that tech workers don\u2019t care about what they wear, but if you look closely at those T-shirts, you\u2019ll see the logos of the wearers\u2019 companies\u2014and tech workers care about those very much. What makes a startup employee instantly distinguishable to outsiders is the branded T-shirt or hoodie that makes him look the same as his co-workers. The startup uniform encapsulates a simple but essential principle: everyone at your company should be different in the same way\u2014a tribe of like-minded people fiercely devoted to the company\u2019s mission.\n\nMax Levchin, my co-founder at PayPal, says that startups should make their early staff as personally similar as possible. Startups have limited resources and small teams. They must work quickly and efficiently in order to survive, and that\u2019s easier to do when everyone shares an understanding of the world. The early PayPal team worked well together because we were all the same kind of nerd. We all loved science fiction: Cryptonomicon was required reading, and we preferred the capitalist Star Wars to the communist Star Trek. Most important, we were all obsessed with creating a digital currency that would be controlled by individuals instead of governments. For the company to work, it didn\u2019t matter what people looked like or which country they came from, but we needed every new hire to be equally obsessed.",null,null,B.i,!0,null)
B.VE=new A.q("Cleantech companies effectively courted government and investors, but they often forgot about customers. They learned the hard way that the world is not a laboratory: selling and delivering a product is at least as important as the product itself.\n\nJust ask Israeli electric vehicle startup Better Place, which from 2007 to 2012 raised and spent more than $800 million to build swappable battery packs and charging stations for electric cars. The company sought to \u201ccreate a green alternative that would lessen our dependence on highly polluting transportation technologies.\u201d And it did just that\u2014at least by 1,000 cars, the number it sold before filing for bankruptcy. Even selling that many was an achievement, because each of those cars was very hard for customers to buy.\n\nFor starters, it was never clear what you were actually buying. Better Place bought sedans from Renault and refitted them with electric batteries and electric motors. So, were you buying an electric Renault, or were you buying a Better Place? In any case, if you decided to buy one, you had to jump through a series of hoops. First, you needed to seek approval from Better Place. To get that, you had to prove that you lived close enough to a Better Place battery swapping station and promise to follow predictable routes. If you passed that test, you had to sign up for a fueling subscription in order to recharge your car. Only then could you get started learning the new behavior of stopping to swap out battery packs on the road.\n\nBetter Place thought its technology spoke for itself, so they didn\u2019t bother to market it clearly. Reflecting on the company\u2019s failure, one frustrated customer asked, \u201cWhy wasn\u2019t there a billboard in Tel Aviv showing a picture of a Toyota Prius for 160,000 shekels and a picture of this car, for 160,000 plus fuel for four years?\u201d He still bought one of the cars, but unlike most people, he was a hobbyist who \u201cwould do anything to keep driving it.\u201d Unfortunately, he can\u2019t: as the Better Place board of directors stated upon selling the company\u2019s assets for a meager $12 million in 2013, \u201cThe technical challenges we overcame successfully, but the other obstacles we were not able to overcome.\u201d",null,null,B.i,!0,null)
B.VF=new A.q("How must you see the world if you don\u2019t believe in secrets? You\u2019d have to believe we\u2019ve already solved all great questions. If today\u2019s conventions are correct, we can afford to be smug and complacent: \u201cGod\u2019s in His heaven, All\u2019s right with the world.\u201d For example, a world without secrets would enjoy a perfect understanding of justice. Every injustice necessarily involves a moral truth that very few people recognize early on: in a democratic society, a wrongful practice persists only when most people don\u2019t perceive it to be unjust. At first, only a small minority of abolitionists knew that slavery was evil; that view has rightly become conventional, but it was still a secret in the early 19th century. To say that there are no secrets left today would mean that we live in a society with no hidden injustices.\n\nIn economics, disbelief in secrets leads to faith in efficient markets. But the existence of financial bubbles shows that markets can have extraordinary inefficiencies. (And the more people believe in efficiency, the bigger the bubbles get.) In 1999, nobody wanted to believe that the internet was irrationally overvalued. The same was true of housing in 2005: Fed chairman Alan Greenspan had to acknowledge some \u201csigns of froth in local markets\u201d but stated that \u201ca bubble in home prices for the nation as a whole does not appear likely.\u201d The market reflected all knowable information and couldn\u2019t be questioned. Then home prices fell across the country, and the financial crisis of 2008 wiped out trillions. The future turned out to hold many secrets that economists could not make vanish simply by ignoring them.\n\nWhat happens when a company stops believing in secrets? The sad decline of Hewlett-Packard provides a cautionary tale. In 1990, the company was worth $9 billion. Then came a decade of invention. In 1991, HP released the DeskJet 500C, the world\u2019s first affordable color printer. In 1993, it launched the OmniBook, one of the first \u201csuperportable\u201d laptops. The next year, HP released the OfficeJet, the world\u2019s first all-in-one printer/fax/copier. This relentless product expansion paid off: by mid-2000, HP was worth $135 billion.\n\nBut starting in late 1999, when HP introduced a new branding campaign around the imperative to \u201cinvent,\u201d it stopped inventing things. In 2001, the company launched HP Services, a glorified consulting and support shop. In 2002, HP merged with Compaq, presumably because it didn\u2019t know what else to do. By 2005, the company\u2019s market cap had plunged to $70 billion\u2014roughly half of what it had been just five years earlier.\n\nHP\u2019s board was a microcosm of the dysfunction: it split into two factions, only one of which cared about new technology. That faction was led by Tom Perkins, an engineer who first came to HP in 1963 to run the company\u2019s research division at the personal request of Bill Hewlett and Dave Packard. At 73 years old in 2005, Perkins may as well have been a time-traveling visitor from a bygone age of optimism: he thought the board should identify the most promising new technologies and then have HP build them. But Perkins\u2019s faction lost out to its rival, led by chairwoman Patricia Dunn. A banker by trade, Dunn argued that charting a plan for future technology was beyond the board\u2019s competence. She thought the board should restrict itself to a night watchman\u2019s role: Was everything proper in the accounting department? Were people following all the rules?\n\nAmid this infighting, someone on the board started leaking information to the press. When it was exposed that Dunn arranged a series of illegal wiretaps to identify the source, the backlash was worse than the original dissension, and the board was disgraced. Having abandoned the search for technological secrets, HP obsessed over gossip. As a result, by late 2012 HP was worth just $23 billion\u2014not much more than it was worth in 1990, adjusting for inflation.",null,null,B.i,!0,null)
B.VG=new A.q("Our results at Founders Fund illustrate this skewed pattern: Facebook, the best investment in our 2005 fund, returned more than all the others combined. Palantir, the second-best investment, is set to return more than the sum of every other investment aside from Facebook. This highly uneven pattern is not unusual: we see it in all our other funds as well. The biggest secret in venture capital is that the best investment in a successful fund equals or outperforms the entire rest of the fund combined.\n\nThis implies two very strange rules for VCs. First, only invest in companies that have the potential to return the value of the entire fund. This is a scary rule, because it eliminates the vast majority of possible investments. (Even quite successful companies usually succeed on a more humble scale.) This leads to rule number two: because rule number one is so restrictive, there can\u2019t be any other rules.\n\nConsider what happens when you break the first rule. Andreessen Horowitz invested $250,000 in Instagram in 2010. When Facebook bought Instagram just two years later for $1 billion, Andreessen netted $78 million\u2014a 312x return in less than two years. That\u2019s a phenomenal return, befitting the firm\u2019s reputation as one of the Valley\u2019s best. But in a weird way it\u2019s not nearly enough, because Andreessen Horowitz has a $1.5 billion fund: if they only wrote $250,000 checks, they would need to find 19 Instagrams just to break even. This is why investors typically put a lot more money into any company worth funding. (And to be fair, Andreessen would have invested more in Instagram\u2019s later rounds had it not been conflicted out by a previous investment.) VCs must find the handful of companies that will successfully go from 0 to 1 and then back them with every resource.\n\nOf course, no one can know with certainty ex ante which companies will succeed, so even the best VC firms have a \u201cportfolio.\u201d However, every single company in a good venture portfolio must have the potential to succeed at vast scale. At Founders Fund, we focus on five to seven companies in a fund, each of which we think could become a multibillion-dollar business based on its unique fundamentals. Whenever you shift from the substance of a business to the financial question of whether or not it fits into a diversified hedging strategy, venture investing starts to look a lot like buying lottery tickets. And once you think that you\u2019re playing the lottery, you\u2019ve already psychologically prepared yourself to lose.",null,null,B.i,!0,null)
B.VI=new A.q("The few who knew what might be learned,\n Foolish enough to put their whole heart on show,\nAnd reveal their feelings to the crowd below, Mankind has always crucified and burned.\n",null,B.jR,B.i,!0,null)
B.VK=new A.q("Your company needs to sell more than its product. You must also sell your company to employees and investors. There is a \u201chuman resources\u201d version of the lie that great products sell themselves: \u201cThis company is so good that people will be clamoring to join it.\u201d And there\u2019s a fundraising version too: \u201cThis company is so great that investors will be banging down our door to invest.\u201d Clamor and frenzy are very real, but they rarely happen without calculated recruiting and pitching beneath the surface.\n\nSelling your company to the media is a necessary part of selling it to everyone else. Nerds who instinctively mistrust the media often make the mistake of trying to ignore it. But just as you can never expect people to buy a superior product merely on its obvious merits without any distribution strategy, you should never assume that people will admire your company without a public relations strategy. Even if your particular product doesn\u2019t need media exposure to acquire customers because you have a viral distribution strategy, the press can help attract investors and employees. Any prospective employee worth hiring will do his own diligence; what he finds or doesn\u2019t find when he googles you will be critical to the success of your company.",null,null,B.i,!0,null)
B.VL=new A.q(" Given the interconnected geography of the contemporary world and the unprecedented destructive power of modern weaponry, it\u2019s hard not to ask whether a large-scale social disaster could be contained were it to occur. This is what fuels our fears of the third possible scenario: a collapse so devastating that we won\u2019t survive it.",null,null,B.i,!0,null)
B.VM=new A.q("IF EVEN THE MOST FARSIGHTED founders cannot plan beyond the next 20 to 30 years, is there anything to say about the very distant future? We don\u2019t know anything specific, but we can make out the broad contours. Philosopher Nick Bostrom describes four possible patterns for the future of humanity. The ancients saw all of history as a never ending alternation between prosperity and ruin. Only recently have people dared to hope that we might permanently escape misfortune, and it\u2019s still possible to wonder whether the stability we take for granted will last.",null,null,B.i,!0,null)
B.VO=new A.q("\nYou can also expect the future to be either better or worse than the present. Optimists welcome the future; pessimists fear it. Combining these possibilities yields four views:\n\n",null,null,B.i,!0,null)
B.VP=new A.q("\nThe error lies in expecting that venture returns will be normally distributed: that is, bad companies will fail, mediocre ones will stay flat, and good ones will return 2x or even 4x. Assuming this bland pattern, investors assemble a diversified portfolio and hope that winners counterbalance losers.\n\nBut this \u201cspray and pray\u201d approach usually produces an entire portfolio of flops, with no hits at all. This is because venture returns don\u2019t follow a normal distribution overall. Rather, they follow a power law: a small handful of companies radically outperform all others. If you focus on diversification instead of single-minded pursuit of the very few companies that can become overwhelmingly valuable, you\u2019ll miss those rare companies in the first place.\n\nThis graph shows the stark reality versus the perceived relative homogeneity:",null,null,B.i,!0,null)
B.VS=new A.q("So, a monopoly is good for everyone on the inside, but what about everyone on the outside? Do outsized profits come at the expense of the rest of society? Actually, yes: profits come out of customers\u2019 wallets, and monopolies deserve their bad reputation \u2014but only in a world where nothing changes.\n\nIn a static world, a monopolist is just a rent collector. If you corner the market for something, you can jack up the price; others will have no choice but to buy from you. Think of the famous board game: deeds are shuffled around from player to player, but the board never changes. There\u2019s no way to win by inventing a better kind of real estate development. The relative values of the properties are fixed for all time, so all you can do is try to buy them up.\n\nBut the world we live in is dynamic: it\u2019s possible to invent new and better things. Creative monopolists give customers more choices by adding entirely new categories of abundance to the world. Creative monopolies aren\u2019t just good for the rest of society; they\u2019re powerful engines for making it better.\n\nEven the government knows this: that\u2019s why one of its departments works hard to create monopolies (by granting patents to new inventions) even though another part hunts them down (by prosecuting antitrust cases). It\u2019s possible to question whether anyone should really be awarded a legally enforceable monopoly simply for having been the first to think of something like a mobile software design. But it\u2019s clear that something like Apple\u2019s monopoly profits from designing, producing, and marketing the iPhone were the reward for creating greater abundance, not artificial scarcity: customers were happy to finally have the choice of paying high prices to get a smartphone that actually works.\n\nThe dynamism of new monopolies itself explains why old monopolies don\u2019t strangle innovation. With Apple\u2019s iOS at the forefront, the rise of mobile computing has dramatically reduced Microsoft\u2019s decades-long operating system dominance. Before that, IBM\u2019s hardware monopoly of the \u201960s and \u201970s was overtaken by Microsoft\u2019s software monopoly. AT&T had a monopoly on telephone service for most of the 20th century, but now anyone can get a cheap cell phone plan from any number of providers. If the tendency of monopoly businesses were to hold back progress, they would be dangerous and we\u2019d be right to oppose them. But the history of progress is a history of better monopoly businesses replacing incumbents.\n\nMonopolies drive progress because the promise of years or even decades of monopoly profits provides a powerful incentive to innovate. Then monopolies can keep innovating because profits enable them to make the long-term plans and to finance the ambitious research projects that firms locked in competition can\u2019t dream of.\n\nSo why are economists obsessed with competition as an ideal state? It\u2019s a relic of history. Economists copied their mathematics from the work of 19th-century physicists: they see individuals and businesses as interchangeable atoms, not as unique creators. Their theories describe an equilibrium state of perfect competition because that\u2019s what\u2019s easy to model, not because it represents the best of business. But it\u2019s worth recalling that the long-run equilibrium predicted by 19th-century physics was a state in which all energy is evenly distributed and everything comes to rest\u2014 also known as the heat death of the universe. Whatever your views on thermodynamics, it\u2019s a powerful metaphor: in business, equilibrium means stasis, and stasis means death. If your industry is in a competitive equilibrium, the death of your business won\u2019t matter to the world; some other undifferentiated competitor will always be ready to take your place.\n\nPerfect equilibrium may describe the void that is most of the universe. It may even characterize many businesses. But every new creation takes place far from equilibrium. In the real world outside economic theory, every business is successful exactly to the extent that it does something others cannot. Monopoly is therefore not a pathology or an exception. Monopoly is the condition of every successful business. Tolstoy opens Anna Karenina by observing: \u201cAll happy families are alike; each unhappy family is unhappy in its own way.\u201d Business is the opposite. All happy companies are different: each one earns a monopoly by solving a unique problem. All failed companies are the same: they failed to escape competition. ",null,null,B.i,!0,null)
B.VT=new A.q("Biotech startups are an extreme example of indefinite thinking. Researchers experiment with things that just might work instead of refining definite theories about how the body\u2019s systems operate. Biologists say they need to work this way because the underlying biology is hard. According to them, IT startups work because we created computers ourselves and designed them to reliably obey our commands. Biotech is difficult because we didn\u2019t design our bodies, and the more we learn about them, the more complex they turn out to be.\n\nBut today it\u2019s possible to wonder whether the genuine difficulty of biology has become an excuse for biotech startups\u2019 indefinite approach to business in general. Most of the people involved expect some things to work eventually, but few want to commit to a specific company with the level of intensity necessary for success. It starts with the professors who often become part-time consultants instead of full-time employees\u2014even for the biotech startups that begin from their own research. Then everyone else imitates the professors\u2019 indefinite attitude. It\u2019s easy for libertarians to claim that heavy regulation holds biotech back\u2014and it does\u2014but indefinite optimism may pose an even greater challenge for the future of biotech.",null,null,B.i,!0,null)
B.VU=new A.q("After 10 years, however, the portfolio won\u2019t be divided between winners and losers; it will be split between one dominant investment and everything else. But no matter how unambiguous the end result of the power law, it doesn\u2019t reflect daily experience. Since investors spend most of their time making new investments and attending to companies in their early stages, most of the companies they work with are by definition average. Most of the differences that investors and entrepreneurs perceive every day are between relative levels of success, not between exponential dominance and failure. And since nobody wants to give up on an investment, VCs usually spend even more time on the most problematic companies than they do on the most obviously successful.",null,null,B.i,!0,null)
B.VV=new A.q("On the inside, every individual should be sharply distinguished by her work.\nWhen assigning responsibilities to employees in a startup, you could start by treating it as a simple optimization problem to efficiently match talents with tasks. But even if you could somehow get this perfectly right, any given solution would quickly break down. Partly that\u2019s because startups have to move fast, so individual roles can\u2019t remain static for long. But it\u2019s also because job assignments aren\u2019t just about the relationships between workers and tasks; they\u2019re also about relationships between employees.\n\nThe best thing I did as a manager at PayPal was to make every person in the company responsible for doing just one thing. Every employee\u2019s one thing was unique, and everyone knew I would evaluate him only on that one thing. I had started doing this just to simplify the task of managing people. But then I noticed a deeper result: defining roles reduced conflict. Most fights inside a company happen when colleagues compete for the same responsibilities. Startups face an especially high risk of this since job roles are fluid at the early stages. Eliminating competition  makes it easier for everyone to build the kinds of long-term relationships that transcend mere professionalism. More than that, internal peace is what enables a startup to survive at all. When a startup fails, we often imagine it succumbing to predatory rivals in a competitive ecosystem. But every company is also its own ecosystem, and factional strife makes it vulnerable to outside threats. Internal conflict is like an autoimmune disease: the technical cause of death may be pneumonia, but the real cause remains hidden from plain view.",null,null,B.i,!0,null)
B.VW=new A.q("Their indefiniteness took different forms. Rawls begins A Theory of Justice with the famous \u201cveil of ignorance\u201d: fair political reasoning is supposed to be impossible for anyone with knowledge of the world as it concretely exists. Instead of trying to change our actual world of unique people and real technologies, Rawls fantasized about an \u201cinherently stable\u201d society with lots of fairness but little dynamism. Nozick opposed Rawls\u2019s \u201cpatterned\u201d concept of justice. To Nozick, any voluntary exchange must be allowed, and no social pattern could be noble enough to justify maintenance by coercion. He didn\u2019t have any more concrete ideas about the good society than Rawls: both of them focused on process. Today, we exaggerate the differences between left-liberal egalitarianism and libertarian individualism because almost everyone shares their common indefinite attitude. In philosophy, politics, and business, too, arguing over process has become a way to endlessly defer making concrete plans for a better future.\n\n",null,null,B.i,!0,null)
B.VX=new A.q("If even investors specializing in exponentially growing startups miss the power law, it\u2019s not surprising that most everyone else misses it, too. Power law distributions are so big that they hide in plain sight. For example, when most people outside Silicon Valley think of venture capital, they might picture a small and quirky coterie \u2014like ABC\u2019s Shark Tank, only without commercials. After all, less than 1% of new businesses started each year in the U.S. receive venture funding, and total VC investment accounts for less than 0.2% of GDP. But the results of those investments disproportionately propel the entire economy. Venture-backed companies create 11% of all private sector jobs. They generate annual revenues equivalent to an astounding 21% of GDP. Indeed, the dozen largest tech companies were all venture-backed. Together those 12 companies are worth more than $2 trillion, more than all other tech companies combined.",null,null,B.i,!0,null)
B.VY=new A.q("The overwhelming importance of future profits is counterintuitive even in Silicon Valley. For a company to be valuable it must grow and endure, but many entrepreneurs focus only on short-term growth. They have an excuse: growth is easy to measure, but durability isn\u2019t. Those who succumb to measurement mania obsess about weekly active user statistics, monthly revenue targets, and quarterly earnings reports. However, you can hit those numbers and still overlook deeper, harder-to-measure problems that threaten the durability of your business.\n\nFor example, rapid short-term growth at both Zynga and Groupon distracted managers and investors from long-term challenges. Zynga scored early wins with games like Farmville and claimed to have a \u201cpsychometric engine\u201d to rigorously gauge the appeal of new releases. But they ended up with the same problem as every Hollywood studio: how can you reliably produce a constant stream of popular entertainment for a fickle audience? (Nobody knows.) Groupon posted fast growth as hundreds of thousands of local businesses tried their product. But persuading those businesses to become repeat customers was harder than they thought.\n\nIf you focus on near-term growth above all else, you miss the most important question you should be asking: will this business still be around a decade from now? Numbers alone won\u2019t tell you the answer; instead you must think critically about the qualitative characteristics of your business.\n",null,null,B.i,!0,null)
B.W_=new A.q("Brand, scale, network effects, and technology in some combination define a monopoly; but to get them to work, you need to choose your market carefully and expand deliberately.\n\n",null,null,B.i,!0,null)
B.W0=new A.q("If you find a secret, you face a choice: Do you tell anyone? Or do you keep it to yourself?\nIt depends on the secret: some are more dangerous than others. As Faust tells Wagner:\n",null,null,B.i,!0,null)
B.W1=new A.q("Recruiting is a core competency for any company. It should never be outsourced. You need people who are not just skilled on paper but who will work together cohesively after they\u2019re hired. The first four or five might be attracted by large equity stakes or high-profile responsibilities. More important than those obvious offerings is your answer to this question: Why should the 20th employee join your company?\n\nTalented people don\u2019t need to work for you; they have plenty of options. You should ask yourself a more pointed version of the question: Why would someone join your company as its 20th engineer when she could go work at Google for more money and more prestige?\n\nHere are some bad answers: \u201cYour stock options will be worth more here than elsewhere.\u201d \u201cYou\u2019ll get to work with the smartest people in the world.\u201d \u201cYou can help solve the world\u2019s most challenging problems.\u201d What\u2019s wrong with valuable stock, smart people, or pressing problems? Nothing\u2014but every company makes these same claims, so they won\u2019t help you stand out. General and undifferentiated pitches don\u2019t say anything about why a recruit should join your company instead of many others.\n\nThe only good answers are specific to your company, so you won\u2019t find them in this book. But there are two general kinds of good answers: answers about your mission and answers about your team. You\u2019ll attract the employees you need if you can explain why your mission is compelling: not why it\u2019s important in general, but why you\u2019re doing something important that no one else is going to get done. That\u2019s the only thing that can make its importance unique. At PayPal, if you were excited by the idea of creating a new digital currency to replace the U.S. dollar, we wanted to talk to you; if not, you weren\u2019t the right fit.\n\nHowever, even a great mission is not enough. The kind of recruit who would be most engaged as an employee will also wonder: \u201cAre these the kind of people I want to work with?\u201d You should be able to explain why your company is a unique match for him personally. And if you can\u2019t do that, he\u2019s probably not the right match. Above all, don\u2019t fight the perk war. Anybody who would be more powerfully swayed by free laundry pickup or pet day care would be a bad addition to your team. Just cover the basics like health insurance and then promise what no others can: the opportunity to do irreplaceable work on a unique problem alongside great people. You probably can\u2019t be the Google of 2014 in terms of compensation or perks, but you can be like the Google of 1999 if you already have good answers about your mission and team.\n",null,null,B.i,!0,null)
B.W2=new A.q("However, we usually suppress our doubts. Conventional wisdom seems to assume instead that the whole world will converge toward a plateau of development similar to the life of the richest countries today. In this scenario, the future will look a lot like the present.",null,null,B.i,!0,null)
B.W3=new A.q("Superior sales and distribution by itself can create a monopoly, even with no product differentiation. The converse is not true. No matter how strong your product\u2014even if it easily fits into already established habits and anybody who tries it likes it immediately\u2014you must still support it with a strong distribution plan. Two metrics set the limits for effective distribution. The total net profit that you earn on average over the course of your relationship with a customer (Customer Lifetime Value, or CLV) must exceed the amount you spend on average to acquire a new customer (Customer Acquisition Cost, or CAC). In general, the higher the price of your product, the more you have to spend to make a sale\u2014and the more it makes sense to spend it. Distribution methods can be plotted on a continuum:",null,null,B.i,!0,null)
B.W5=new A.q("What would it mean to prioritize design over chance? Today, \u201cgood design\u201d is an aesthetic imperative, and everybody from slackers to yuppies carefully \u201ccurates\u201d their outward appearance. It\u2019s true that every great entrepreneur is first and foremost a designer. Anyone who has held an iDevice or a smoothly machined MacBook has felt the result of Steve Jobs\u2019s obsession with visual and experiential perfection. But the most important lesson to learn from Jobs has nothing to do with aesthetics. The greatest thing Jobs designed was his business. Apple imagined and executed definite multi-year plans to create new products and distribute them effectively. Forget \u201cminimum viable products\u201d\u2014ever since he started Apple in 1976, Jobs saw that you can change the world through careful planning, not by listening to focus group feedback or copying others\u2019 successes.\n\nLong-term planning is often undervalued by our indefinite short-term world. When the first iPod was released in October 2001, industry analysts couldn\u2019t see much more than \u201ca nice feature for Macintosh users\u201d that \u201cdoesn\u2019t make any difference\u201d to the rest of the world. Jobs planned the iPod to be the first of a new generation of portable post-PC devices, but that secret was invisible to most people. One look at the company\u2019s stock chart shows the harvest of this multi-year plan: ",null,null,B.i,!0,null)
B.W6=new A.q("The power of planning explains the difficulty of valuing private companies.  When a big company makes an offer to acquire a successful startup, it almost always offers too much or too little: founders only sell when they have no more concrete visions for the company, in which case the acquirer probably overpaid; definite founders with robust plans don\u2019t sell, which means the offer wasn\u2019t high enough. When Yahoo! offered to buy Facebook for $1 billion in July 2006, I thought we should at least consider it. But Mark Zuckerberg walked into the board meeting and announced: \u201cOkay, guys, this is just a formality, it shouldn\u2019t take more than 10 minutes. We\u2019re obviously not going to sell here.\u201d Mark saw where he could take the company, and Yahoo! didn\u2019t. A business with a good definite plan will always be underrated in a world where people see the future as random.",null,null,B.i,!0,null)
B.W8=new A.q("The hazards of imitative competition may partially explain why individuals with an Asperger\u2019s-like social ineptitude seem to be at an advantage in Silicon Valley today. If you\u2019re less sensitive to social cues, you\u2019re less likely to do the same things as everyone else around you. If you\u2019re interested in making things or programming computers, you\u2019ll be less afraid to pursue those activities single-mindedly and thereby become incredibly good at them. Then when you apply your skills, you\u2019re a little less likely than others to give up your own convictions: this can save you from getting caught up in crowds competing for obvious prizes.\n\nCompetition can make people hallucinate opportunities where none exist. The crazy \u201990s version of this was the fierce battle for the online pet store market. It was Pets.com vs. PetStore.com vs. Petopia.com vs. what seemed like dozens of others. Each company was obsessed with defeating its rivals, precisely because there were no substantive differences to focus on. Amid all the tactical questions\u2014Who could price chewy dog toys most aggressively? Who could create the best Super Bowl ads?\u2014 these companies totally lost sight of the wider question of whether the online pet supply market was the right space to be in. Winning is better than losing, but everybody loses when the war isn\u2019t one worth fighting. When Pets.com folded after the dot-com crash, $300 million of investment capital disappeared with it.\n\nOther times, rivalry is just weird and distracting. Consider the Shakespearean conflict between Larry Ellison, co-founder and CEO of Oracle, and Tom Siebel, a top salesman at Oracle and Ellison\u2019s prot\xe9g\xe9 before he went on to found Siebel Systems in 1993. Ellison was livid at what he thought was Siebel\u2019s betrayal. Siebel hated being in the shadow of his former boss. The two men were basically identical\u2014 hard-charging Chicagoans who loved to sell and hated to lose\u2014so their hatred ran deep. Ellison and Siebel spent the second half of the \u201990s trying to sabotage each other. At one point, Ellison sent truckloads of ice cream sandwiches to Siebel\u2019s headquarters to try to convince Siebel employees to jump ship. The copy on the wrappers? \u201cSummer is near. Oracle is here. To brighten your day and your career.\u201d Strangely, Oracle intentionally accumulated enemies. Ellison\u2019s theory was that it\u2019s always good to have an enemy, so long as it was large enough to appear threatening (and thus motivational to employees) but not so large as to actually threaten the company. So Ellison was probably thrilled when in 1996 a small database company called Informix put up a billboard near Oracle\u2019s Redwood Shores headquarters that read: CAUTION: DINOSAUR CROSSING. Another Informix billboard on northbound Highway 101 read: YOU\u2019VE JUST PASSED REDWOOD SHORES. SO DID WE.\n\nOracle shot back with a billboard that implied that Informix\u2019s software was slower than snails. Then Informix CEO Phil White decided to make things personal. When White learned that Larry Ellison enjoyed Japanese samurai culture, he commissioned a new billboard depicting the Oracle logo along with a broken samurai sword. The ad wasn\u2019t even really aimed at Oracle as an entity, let alone the consuming public; it was a personal attack on Ellison. But perhaps White spent a little too much time worrying about the competition: while he was busy creating billboards, Informix imploded in a massive accounting scandal and White soon found himself in federal prison for securities fraud.\n\nIf you can\u2019t beat a rival, it may be better to merge. I started Confinity with my co-founder Max Levchin in 1998. When we released the PayPal product in late 1999, Elon Musk\u2019s X.com was right on our heels: our companies\u2019 offices were four blocks apart on University Avenue in Palo Alto, and X\u2019s product mirrored ours feature-for- feature. By late 1999, we were in all-out war. Many of us at PayPal logged 100-hour workweeks. No doubt that was counterproductive, but the focus wasn\u2019t on objective productivity; the focus was defeating X.com. One of our engineers actually designed a bomb for this purpose; when he presented the schematic at a team meeting, calmer heads prevailed and the proposal was attributed to extreme sleep deprivation.\n\nBut in February 2000, Elon and I were more scared about the rapidly inflating tech bubble than we were about each other: a financial crash would ruin us both before we could finish our fight. So in early March we met on neutral ground\u2014a caf\xe9 almost exactly equidistant to our offices\u2014and negotiated a 50-50 merger. De- escalating the rivalry post-merger wasn\u2019t easy, but as far as problems go, it was a good one to have. As a unified team, we were able to ride out the dot-com crash and then build a successful business.\n\nSometimes you do have to fight. Where that\u2019s true, you should fight and win. There is no middle ground: either don\u2019t throw any punches, or strike hard and end it quickly.\n\nThis advice can be hard to follow because pride and honor can get in the way. Hence Hamlet:\n",null,null,B.i,!0,null)
B.Wa=new A.q("To a definite optimist, the future will be better than the present if he plans and works to make it better. From the 17th century through the 1950s and \u201960s, definite optimists led the Western world. Scientists, engineers, doctors, and businessmen made the world richer, healthier, and more long-lived than previously imaginable. As Karl Marx and Friedrich Engels saw clearly, the 19th-century business class\n\ncreated more massive and more colossal productive forces than all preceding generations together. Subjection of Nature\u2019s forces to man, machinery, application of chemistry to industry and agriculture, steam-navigation, railways, electric telegraphs, clearing of whole continents for cultivation, canalisation of rivers, whole populations conjured out of the ground\u2014what earlier century had even a presentiment that such productive forces slumbered in the lap of social labor?\n\nEach generation\u2019s inventors and visionaries surpassed their predecessors. In 1843, the London public was invited to make its first crossing underneath the River Thames by a newly dug tunnel. In 1869, the Suez Canal saved Eurasian shipping traffic from rounding the Cape of Good Hope. In 1914 the Panama Canal cut short the route from Atlantic to Pacific. Even the Great Depression failed to impede relentless progress in the United States, which has always been home to the world\u2019s most far-seeing definite optimists. The Empire State Building was started in 1929 and finished in 1931. The Golden Gate Bridge was started in 1933 and completed in 1937. The Manhattan Project was started in 1941 and had already produced the world\u2019s first nuclear bomb by 1945. Americans continued to remake the face of the world in peacetime: the Interstate Highway System began construction in 1956, and the first 20,000 miles of road were open for driving by 1965. Definite planning even went beyond the surface of this planet: NASA\u2019s Apollo Program began in 1961 and put 12 men on the moon before it finished in 1972.\n\nBold plans were not reserved just for political leaders or government scientists. In the late 1940s, a Californian named John Reber set out to reinvent the physical geography of the whole San Francisco Bay Area. Reber was a schoolteacher, an amateur theater producer, and a self-taught engineer. Undaunted by his lack of credentials, he publicly proposed to build two huge dams in the Bay, construct  massive freshwater lakes for drinking water and irrigation, and reclaim 20,000 acres of land for development. Even though he had no personal authority, people took the Reber Plan seriously. It was endorsed by newspaper editorial boards across California. The U.S. Congress held hearings on its feasibility. The Army Corps of Engineers even constructed a 1.5-acre scale model of the Bay in a cavernous Sausalito warehouse to simulate it. These tests revealed technical shortcomings, so the plan wasn\u2019t executed.\n\nBut would anybody today take such a vision seriously in the first place? In the 1950s, people welcomed big plans and asked whether they would work. Today a grand plan coming from a schoolteacher would be dismissed as crankery, and a long-range vision coming from anyone more powerful would be derided as hubris. You can still visit the Bay Model in that Sausalito warehouse, but today it\u2019s just a tourist attraction: big plans for the future have become archaic curiosities.\n",null,null,B.i,!0,null)
B.Wc=new A.q("If your average sale is seven figures or more, every detail of every deal requires close personal attention. It might take months to develop the right relationships. You might make a sale only once every year or two. Then you\u2019ll usually have to follow up during installation and service the product long after the deal is done. It\u2019s hard to do, but this kind of \u201ccomplex sales\u201d is the only way to sell some of the most valuable products.\n\nSpaceX shows that it can be done. Within just a few years of launching his rocket startup, Elon Musk persuaded NASA to sign billion-dollar contracts to replace the decommissioned space shuttle with a newly designed vessel from SpaceX. Politics matters in big deals just as much as technological ingenuity, so this wasn\u2019t easy. SpaceX employs more than 3,000 people, mostly in California. The traditional U.S. aerospace industry employs more than 500,000 people, spread throughout all 50 states. Unsurprisingly, members of Congress don\u2019t want to give up federal funds going to their home districts. But since complex sales requires making just a few deals each year, a sales grandmaster like Elon Musk can use that time to focus on the most crucial people\u2014and even to overcome political inertia.\n\nComplex sales works best when you don\u2019t have \u201csalesmen\u201d at all. Palantir, the data analytics company I co-founded with my law school classmate Alex Karp, doesn\u2019t employ anyone separately tasked with selling its product. Instead, Alex, who is Palantir\u2019s CEO, spends 25 days a month on the road, meeting with clients and potential clients. Our deal sizes range from $1 million to $100 million. At that price point, buyers want to talk to the CEO, not the VP of Sales.\n\nBusinesses with complex sales models succeed if they achieve 50% to 100% year-over-year growth over the course of a decade. This will seem slow to any entrepreneur dreaming of viral growth. You might expect revenue to increase 10x as soon as customers learn about an obviously superior product, but that almost never happens. Good enterprise sales strategy starts small, as it must: a new customer might agree to become your biggest customer, but they\u2019ll rarely be comfortable signing a deal completely out of scale with what you\u2019ve sold before. Once you have a pool of reference customers who are successfully using your product, then you can begin the long and methodical work of hustling toward ever bigger deals.",null,null,B.i,!0,null)
B.Wd=new A.q("Life is a long journey; the road marked out by the steps of previous travelers has no end in sight. But later on in the tale, another verse appears:\n",null,null,B.i,!0,null)
B.We=new A.q("Over the next few years, some companies will fail while others begin to succeed; valuations will diverge, but the difference between exponential growth and linear growth will be unclear.",null,null,B.i,!0,null)
B.Wg=new A.q("You can\u2019t find secrets without looking for them. Andrew Wiles demonstrated this when he proved Fermat\u2019s Last Theorem after 358 years of fruitless inquiry by other mathematicians\u2014the kind of sustained failure that might have suggested an inherently impossible task. Pierre de Fermat had conjectured in 1637 that no integers a, b, and c could satisfy the equation an + bn = c n for any integer n greater than 2. He claimed to have a proof, but he died without writing it down, so his conjecture long remained a major unsolved problem in mathematics. Wiles started working on it in 1986, but he kept it a secret until 1993, when he knew he was nearing a solution. After nine years of hard work, Wiles proved the conjecture in 1995. He needed brilliance to succeed, but he also needed a faith in secrets. If you think something hard is impossible, you\u2019ll never even start trying to achieve it. Belief in secrets is an effective truth.\n\nThe actual truth is that there are many more secrets left to find, but they will yield only to relentless searchers. There is more to do in science, medicine, engineering, and in technology of all kinds. We are within reach not just of marginal goals set at the competitive edge of today\u2019s conventional disciplines, but of ambitions so great that even the boldest minds of the Scientific Revolution hesitated to announce them directly. We could cure cancer, dementia, and all the diseases of age and metabolic decay. We can find new ways to generate energy that free the world from conflict over fossil fuels. We can invent faster ways to travel from place to place over the surface of the planet; we can even learn how to escape it entirely and settle new frontiers. But we will never learn any of these secrets unless we demand to know them and force ourselves to look.\n\nThe same is true of business. Great companies can be built on open but unsuspected secrets about how the world works. Consider the Silicon Valley startups that have harnessed the spare capacity that is all around us but often ignored. Before Airbnb, travelers had little choice but to pay high prices for a hotel room, and property owners couldn\u2019t easily and reliably rent out their unoccupied space. Airbnb saw untapped supply and unaddressed demand where others saw nothing at all. The same is true of private car services Lyft and Uber. Few people imagined that it was possible to build a billion-dollar business by simply connecting people who want to go places with people willing to drive them there. We already had state-licensed taxicabs and private limousines; only by believing in and looking for secrets could you see beyond the convention to an opportunity hidden in plain sight. The same reason that so many internet companies, including Facebook, are often underestimated\u2014their very simplicity\u2014is itself an argument for secrets. If insights that look so elementary in retrospect can support important and valuable businesses, there must remain many great companies still to start.",null,null,B.i,!0,null)
B.Wh=new A.q("The best startups might be considered slightly less extreme kinds of cults. The biggest difference is that cults tend to be fanatically wrong about something important. People at a successful startup are fanatically right about something those outside it have missed. You\u2019re not going to learn those kinds of secrets from consultants, and you don\u2019t need to worry if your company doesn\u2019t make sense to conventional professionals. Better to be called a cult\u2014or even a mafia. ",null,null,B.i,!0,null)
B.Wj=new A.q("In the most intense kind of organization, members hang out only with other members. They ignore their families and abandon the outside world. In exchange, they experience strong feelings of belonging, and maybe get access to esoteric \u201ctruths\u201d denied to ordinary people. We have a word for such organizations: cults. Cultures of total dedication look crazy from the outside, partly because the most notorious cults were homicidal: Jim Jones and Charles Manson did not make good exits.\n\nBut entrepreneurs should take cultures of extreme dedication seriously. Is a lukewarm attitude to one\u2019s work a sign of mental health? Is a merely professional attitude the only sane approach? The extreme opposite of a cult is a consulting firm like Accenture: not only does it lack a distinctive mission of its own, but individual consultants are regularly dropping in and out of companies to which they have no long-term connection whatsoever.\nEvery company culture can be plotted on a linear spectrum:",null,null,B.i,!0,null)
B.Wk=new A.q("Why would professional VCs, of all people, fail to see the power law? For one thing, it only becomes clear over time, and even technology investors too often live in the present. Imagine a firm invests in 10 companies with the potential to become monopolies\u2014already an unusually disciplined portfolio. Those companies will look very similar in the early stages before exponential growth.",null,null,B.i,!0,null)
