B.Wo=new A.q("Proprietary technology is the most substantive advantage a company can have because it makes your product difficult or impossible to replicate. Google\u2019s search algorithms, for example, return results better than anyone else\u2019s. Proprietary technologies for extremely short page load times and highly accurate query autocompletion add to the core search product\u2019s robustness and defensibility. It would be very hard for anyone to do to Google what Google did to all the other search engine companies in the early 2000s.\n\nAs a good rule of thumb, proprietary technology must be at least 10 times better than its closest substitute in some important dimension to lead to a real monopolistic advantage. Anything less than an order of magnitude better will probably be perceived as a marginal improvement and will be hard to sell, especially in an already crowded market.\n\nThe clearest way to make a 10x improvement is to invent something completely new. If you build something valuable where there was nothing before, the increase in value is theoretically infinite. A drug to safely eliminate the need for sleep, or a cure for baldness, for example, would certainly support a monopoly business. Or you can radically improve an existing solution: once you\u2019re 10x better, you escape competition. PayPal, for instance, made buying and selling on eBay at least 10 times better. Instead of mailing a check that would take 7 to 10 days to arrive, PayPal let buyers pay as soon as an auction ended. Sellers received their proceeds right away, and unlike with a check, they knew the funds were good.\n\nAmazon made its first 10x improvement in a particularly visible way: they offered at least 10 times as many books as any other bookstore. When it launched in 1995, Amazon could claim to be \u201cEarth\u2019s largest bookstore\u201d because, unlike a retail bookstore that might stock 100,000 books, Amazon didn\u2019t need to physically store any inventory\u2014it simply requested the title from its supplier whenever a customer made an order. This quantum improvement was so effective that a very unhappy Barnes & Noble filed a lawsuit three days before Amazon\u2019s IPO, claiming that Amazon was unfairly calling itself a \u201cbookstore\u201d when really it was a \u201cbook broker.\u201d\n\nYou can also make a 10x improvement through superior integrated design. Before 2010, tablet computing was so poor that for all practical purposes the market didn\u2019t even exist. \u201cMicrosoft Windows XP Tablet PC Edition\u201d products first shipped in 2002, and Nokia released its own \u201cInternet Tablet\u201d in 2005, but they were a pain to use. Then Apple released the iPad. Design improvements are hard to measure, but it seems clear that Apple improved on anything that had come before by at least an order of magnitude: tablets went from unusable to useful.\n",null,null,B.i,!0,null)
B.Wp=new A.q("There are two kinds of secrets: secrets of nature and secrets about people. Natural secrets exist all around us; to find them, one must study some undiscovered aspect of the physical world. Secrets about people are different: they are things that people don\u2019t know about themselves or things they hide because they don\u2019t want others to know. So when thinking about what kind of company to build, there are two distinct questions to ask: What secrets is nature not telling you? What secrets are people not telling you?\n\nIt\u2019s easy to assume that natural secrets are the most important: the people who look for them can sound intimidatingly authoritative. This is why physics PhDs are notoriously difficult to work with\u2014because they know the most fundamental truths, they think they know all truths. But does understanding electromagnetic theory automatically make you a great marriage counselor? Does a gravity theorist know more about your business than you do? At PayPal, I once interviewed a physics PhD for an engineering job. Halfway through my first question, he shouted, \u201cStop! I already know what you\u2019re going to ask!\u201d But he was wrong. It was the easiest no-hire decision I\u2019ve ever made.\n\nSecrets about people are relatively underappreciated. Maybe that\u2019s because you don\u2019t need a dozen years of higher education to ask the questions that uncover them: What are people not allowed to talk about? What is forbidden or taboo? Sometimes looking for natural secrets and looking for human secrets lead to the same truth. Consider the monopoly secret again: competition and capitalism are opposites. If you didn\u2019t already know it, you could discover it the natural, empirical way: do a quantitative study of corporate profits and you\u2019ll see they\u2019re eliminated by competition. But you could also take the human approach and ask: what are people running companies not allowed to say? You would notice that monopolists downplay their monopoly status to avoid scrutiny, while competitive firms strategically exaggerate their uniqueness. The differences between firms only seem small on the surface; in fact, they are enormous.\n\nThe best place to look for secrets is where no one else is looking. Most people think only in terms of what they\u2019ve been taught; schooling itself aims to impart conventional wisdom. So you might ask: are there any fields that matter but haven\u2019t been standardized and institutionalized? Physics, for example, is a real major at all major universities, and it\u2019s set in its ways. The opposite of physics might be astrology, but astrology doesn\u2019t matter. What about something like nutrition? Nutrition matters for everybody, but you can\u2019t major in it at Harvard. Most top scientists go into other fields. Most of the big studies were done 30 or 40 years ago, and most are seriously flawed. The food pyramid that told us to eat low fat and enormous amounts of grains was probably more a product of lobbying by Big Food than real science; its chief impact has been to aggravate our obesity epidemic. There\u2019s plenty more to learn: we know more about the physics of faraway stars than we know about human nutrition. It won\u2019t be easy, but it\u2019s not obviously impossible: exactly the kind of field that could yield secrets.",null,null,B.i,!0,null)
B.Wq=new A.q("In March 2001, PayPal had yet to make a profit but our revenues were growing 100% year-over-year. When I projected our future cash flows, I found that 75% of the company\u2019s present value would come from profits generated in 2011 and beyond\u2014hard to believe for a company that had been in business for only 27 months. But even that turned out to be an underestimation. Today, PayPal continues to grow at about 15% annually, and the discount rate is lower than a decade ago. It now appears that most of the company\u2019s value will come from 2020 and beyond.\n\nLinkedIn is another good example of a company whose value exists in the far future. As of early 2014, its market capitalization was $24.5 billion\u2014very high for a company with less than $1 billion in revenue and only $21.6 million in net income for 2012. You might look at these numbers and conclude that investors have gone insane. But this valuation makes sense when you consider LinkedIn\u2019s projected future cash flows.\n",null,null,B.i,!0,null)
B.Wr=new A.q("EVEN THOUGH SALES is everywhere, most people underrate its importance. Silicon Valley underrates it more than most. The geek classic The Hitchhiker\u2019s Guide to the Galaxy even explains the founding of our planet as a reaction against salesmen. When an imminent catastrophe requires the evacuation of humanity\u2019s original home, the population escapes on three giant ships. The thinkers, leaders, and achievers take the A Ship; the salespeople and consultants get the B Ship; and the workers and artisans take the C Ship. The B Ship leaves first, and all its passengers rejoice vainly. But the salespeople don\u2019t realize they are caught in a ruse: the A Ship and C Ship people had always thought that the B Ship people were useless, so they conspired to get rid of them. And it was the B Ship that landed on Earth.\n\nDistribution may not matter in fictional worlds, but it matters in ours. We underestimate the importance of distribution\u2014a catchall term for everything it takes to sell a product\u2014because we share the same bias the A Ship and C Ship people had: salespeople and other \u201cmiddlemen\u201d supposedly get in the way, and distribution should flow magically from the creation of a good product. The Field of Dreams conceit is especially popular in Silicon Valley, where engineers are biased toward building cool stuff rather than selling it. But customers will not come just because you build it. You have to make that happen, and it\u2019s harder than it looks.",null,null,B.i,!0,null)
B.Ws=new A.q("Where does this strange and extreme combination of traits come from? They could be present from birth (nature) or acquired from an individual\u2019s environment (nurture). But perhaps founders aren\u2019t really as extreme as they appear. Might they strategically exaggerate certain qualities? Or is it possible that everyone else exaggerates them? All of these effects can be present at the same time, and whenever present they powerfully reinforce each other. The cycle usually starts with unusual people and ends with them acting and seeming even more unusual:\n",null,null,B.i,!0,null)
B.Wt=new A.q("Another example is Sean Parker, who started out with the ultimate outsider status: criminal. Sean was a careful hacker in high school. But his father decided that Sean was spending too much time on the computer for a 16-year-old, so one day he took away Sean\u2019s keyboard mid-hack. Sean couldn\u2019t log out; the FBI noticed; soon federal agents were placing him under arrest.\n\nSean got off easy since he was a minor; if anything, the episode emboldened him. Three years later, he co-founded Napster. The peer-to-peer file sharing service amassed 10 million users in its first year, making it one of the fastest-growing businesses of all time. But the record companies sued and a federal judge ordered it shut down 20 months after opening. After a whirlwind period at the center, Sean was back to being an outsider again.\n\nThen came Facebook. Sean met Mark Zuckerberg in 2004, helped negotiate Facebook\u2019s first funding, and became the company\u2019s founding president. He had to step down in 2005 amid allegations of drug use, but this only enhanced his notoriety. Ever since Justin Timberlake portrayed him in The Social Network, Sean has been perceived as one of the coolest people in America. JT is still more famous, but when he visits Silicon Valley, people ask if he\u2019s Sean Parker.",null,null,B.i,!0,null)
B.Wu=new A.q("Complementarity between computers and humans isn\u2019t just a macro-scale fact. It\u2019s also the path to building a great business. I came to understand this from my experience at PayPal. In mid-2000, we had survived the dot-com crash and we were growing fast, but we faced one huge problem: we were losing upwards of $10 million to credit card fraud every month. Since we were processing hundreds or even thousands of transactions per minute, we couldn\u2019t possibly review each one\u2014no human quality control team could work that fast.\n\nSo we did what any group of engineers would do: we tried to automate a solution. First, Max Levchin assembled an elite team of mathematicians to study the fraudulent transfers in detail. Then we took what we learned and wrote software to automatically identify and cancel bogus transactions in real time. But it quickly became clear that this approach wouldn\u2019t work either: after an hour or two, the thieves would catch on and change their tactics. We were dealing with an adaptive enemy, and our software couldn\u2019t adapt in response.\n\nThe fraudsters\u2019 adaptive evasions fooled our automatic detection algorithms, but we found that they didn\u2019t fool our human analysts as easily. So Max and his engineers rewrote the software to take a hybrid approach: the computer would flag the most suspicious transactions on a well-designed user interface, and human operators would make the final judgment as to their legitimacy. Thanks to this hybrid system\u2014we named it \u201cIgor,\u201d after the Russian fraudster who bragged that we\u2019d never be able to stop him\u2014we turned our first quarterly profit in the first quarter of 2002 (as opposed to a quarterly loss of $29.3 million one year before). The FBI asked us if we\u2019d let them use Igor to help detect financial crime. And Max was able to boast, grandiosely but truthfully, that he was \u201cthe Sherlock Holmes of the Internet Underground.\u201d\n\nThis kind of man-machine symbiosis enabled PayPal to stay in business, which in turn enabled hundreds of thousands of small businesses to accept the payments they needed to thrive on the internet. None of it would have been possible without the man-machine solution\u2014even though most people would never see it or even hear about it.\n\nI continued to think about this after we sold PayPal in 2002: if humans and computers together could achieve dramatically better results than either could attain alone, what other valuable businesses could be built on this core principle? The next year, I pitched Alex Karp, an old Stanford classmate, and Stephen Cohen, a software engineer, on a new startup idea: we would use the human-computer hybrid approach from PayPal\u2019s security system to identify terrorist networks and financial fraud. We already knew the FBI was interested, and in 2004 we founded Palantir, a software company that helps people extract insight from divergent sources of information. The company is on track to book sales of $1 billion in 2014, and Forbes has called Palantir\u2019s software the \u201ckiller app\u201d for its rumored role in helping the government locate Osama bin Laden.\n\nWe have no details to share from that operation, but we can say that neither human intelligence by itself nor computers alone will be able to make us safe. America\u2019s two biggest spy agencies take opposite approaches: The Central Intelligence Agency is run by spies who privilege humans. The National Security Agency is run by generals who prioritize computers. CIA analysts have to wade through so much noise that it\u2019s very difficult to identify the most serious threats. NSA computers can process huge quantities of data, but machines alone cannot authoritatively determine whether someone is plotting a terrorist act. Palantir aims to transcend these opposing biases: its software analyzes the data the government feeds it\u2014phone records of radical clerics in Yemen or bank accounts linked to terror cell activity, for instance\u2014and flags suspicious activities for a trained analyst to review.\n\nIn addition to helping find terrorists, analysts using Palantir\u2019s software have been able to predict where insurgents plant IEDs in Afghanistan; prosecute high-profile insider trading cases; take down the largest child pornography ring in the world; support the Centers for Disease Control and Prevention in fighting foodborne disease outbreaks; and save both commercial banks and the government hundreds of millions of dollars annually through advanced fraud detection. Advanced software made this possible, but even more important were the human analysts, prosecutors, scientists, and financial professionals without whose active engagement the software would have been useless.\n\nThink of what professionals do in their jobs today. Lawyers must be able to articulate solutions to thorny problems in several different ways\u2014the pitch changes depending on whether you\u2019re talking to a client, opposing counsel, or a judge. Doctors need to marry clinical understanding with an ability to communicate it to non-expert patients. And good teachers aren\u2019t just experts in their disciplines: they must also understand how to tailor their instruction to different individuals\u2019 interests and learning styles. Computers might be able to do some of these tasks, but they can\u2019t combine them effectively. Better technology in law, medicine, and education won\u2019t replace professionals; it will allow them to do even more.\n\nLinkedIn has done exactly this for recruiters. When LinkedIn was founded in 2003, they didn\u2019t poll recruiters to find discrete pain points in need of relief. And they didn\u2019t try to write software that would replace recruiters outright. Recruiting is part detective work and part sales: you have to scrutinize applicants\u2019 history, assess their motives and compatibility, and persuade the most promising ones to join you. Effectively replacing all those functions with a computer would be impossible.  Instead, LinkedIn set out to transform how recruiters did their jobs. Today, more than 97% of recruiters use LinkedIn and its powerful search and filtering functionality to source job candidates, and the network also creates value for the hundreds of millions of professionals who use it to manage their personal brands. If LinkedIn had tried to simply replace recruiters with technology, they wouldn\u2019t have a business today.",null,null,B.i,!0,null)
B.Wv=new A.q("The 1990s have a good image. We tend to remember them as a prosperous, optimistic decade that happened to end with the internet boom and bust. But many of those years were not as cheerful as our nostalgia holds. We\u2019ve long since forgotten the global context for the 18 months of dot-com mania at decade\u2019s end.\n\nThe \u201990s started with a burst of euphoria when the Berlin Wall came down in November \u201989. It was short-lived. By mid-1990, the United States was in recession. Technically the downturn ended in March \u201991, but recovery was slow and unemployment continued to rise until July \u201992. Manufacturing never fully rebounded. The shift to a service economy was protracted and painful.\n\n1992 through the end of 1994 was a time of general malaise. Images of dead American soldiers in Mogadishu looped on cable news. Anxiety about globalization and U.S. competitiveness intensified as jobs flowed to Mexico. This pessimistic undercurrent drove then-president Bush 41 out of office and won Ross Perot nearly 20% of the popular vote in \u201992\u2014the best showing for a third-party candidate since Theodore Roosevelt in 1912. And whatever the cultural fascination with Nirvana, grunge, and heroin reflected, it wasn\u2019t hope or confidence.\n\nSilicon Valley felt sluggish, too. Japan seemed to be winning the semiconductor war. The internet had yet to take off, partly because its commercial use was restricted until late 1992 and partly due to the lack of user-friendly web browsers. It\u2019s telling that when I arrived at Stanford in 1985, economics, not computer science, was the most popular major. To most people on campus, the tech sector seemed idiosyncratic or even provincial.\n\nThe internet changed all this. The Mosaic browser was officially released in November 1993, giving regular people a way to get online. Mosaic became Netscape, which released its Navigator browser in late 1994. Navigator\u2019s adoption grew so quickly\u2014from about 20% of the browser market in January 1995 to almost 80% less than 12 months later\u2014that Netscape was able to IPO in August \u201995 even though it wasn\u2019t yet profitable. Within five months, Netscape stock had shot up from $28 to $174 per share. Other tech companies were booming, too. Yahoo! went public in April \u201996 with an $848 million valuation. Amazon followed suit in May \u201997 at $438 million. By spring of \u201998, each company\u2019s stock had more than quadrupled. ",null,null,B.i,!0,null)
B.Ww=new A.q("All salesmen are actors: their priority is persuasion, not sincerity. That\u2019s why the word \u201csalesman\u201d can be a slur and the used car dealer is our archetype of shadiness. But we only react negatively to awkward, obvious salesmen\u2014that is, the bad ones. There\u2019s a wide range of sales ability: there are many gradations between novices, experts, and masters. There are even sales grandmasters. If you don\u2019t know any grandmasters, it\u2019s not because you haven\u2019t encountered them, but rather because their art is hidden in plain sight. Tom Sawyer managed to persuade his neighborhood friends to whitewash the fence for him\u2014a masterful move. But convincing them to actually pay him for the privilege of doing his chores was the move of a grandmaster, and his friends were none the wiser. Not much has changed since Twain wrote in 1876.\n\nLike acting, sales works best when hidden. This explains why almost everyone whose job involves distribution\u2014whether they\u2019re in sales, marketing, or advertising \u2014has a job title that has nothing to do with those things. People who sell advertising are called \u201caccount executives.\u201d People who sell customers work in \u201cbusiness development.\u201d People who sell companies are \u201cinvestment bankers.\u201d And people who sell themselves are called \u201cpoliticians.\u201d There\u2019s a reason for these redescriptions: none of us wants to be reminded when we\u2019re being sold.\n\nWhatever the career, sales ability distinguishes superstars from also-rans. On Wall Street, a new hire starts as an \u201canalyst\u201d wielding technical expertise, but his goal is to become a dealmaker. A lawyer prides himself on professional credentials, but law firms are led by the rainmakers who bring in big clients. Even university professors, who claim authority from scholarly achievement, are envious of the self-promoters who define their fields. Academic ideas about history or English don\u2019t just sell themselves on their intellectual merits. Even the agenda of fundamental physics and the future path of cancer research are results of persuasion. The most fundamental reason that even businesspeople underestimate the importance of sales is the systematic effort to hide it at every level of every field in a world secretly driven by it.\n\nThe engineer\u2019s grail is a product great enough that \u201cit sells itself.\u201d But anyone who would actually say this about a real product must be lying: either he\u2019s delusional (lying to himself) or he\u2019s selling something (and thereby contradicting himself). The polar opposite business clich\xe9 warns that \u201cthe best product doesn\u2019t always win.\u201d Economists attribute this to \u201cpath dependence\u201d: specific historical circumstances independent of objective quality can determine which products enjoy widespread adoption. That\u2019s true, but it doesn\u2019t mean the operating systems we use today and the keyboard layouts on which we type were imposed by mere chance. It\u2019s better to think of distribution as something essential to the design of your product. If you\u2019ve invented something new but you haven\u2019t invented an effective way to sell it, you have a bad business\u2014no matter how good the product.",null,null,B.i,!0,null)
