B.Wx=new A.q("In the 1950s, Americans thought big plans for the future were too important to be left to experts.\n\n",null,B.Qr,B.E,null,null)
B.Wy=new A.q("Why do so many people miss the power of complementarity? It starts in school. Software engineers tend to work on projects that replace human efforts because that\u2019s what they\u2019re trained to do. Academics make their reputations through specialized research; their primary goal is to publish papers, and publication means respecting the limits of a particular discipline. For computer scientists, that means reducing human capabilities into specialized tasks that computers can be trained to conquer one by one.\n\nJust look at the trendiest fields in computer science today. The very term \u201cmachine learning\u201d evokes imagery of replacement, and its boosters seem to believe that computers can be taught to perform almost any task, so long as we feed them enough training data. Any user of Netflix or Amazon has experienced the results of machine learning firsthand: both companies use algorithms to recommend products based on your viewing and purchase history. Feed them more data and the recommendations get ever better. Google Translate works the same way, providing rough but serviceable translations into any of the 80 languages it supports\u2014not because the software understands human language, but because it has extracted patterns through statistical analysis of a huge corpus of text.\n\nThe other buzzword that epitomizes a bias toward substitution is \u201cbig data.\u201d Today\u2019s companies have an insatiable appetite for data, mistakenly believing that more data always creates more value. But big data is usually dumb data. Computers can find patterns that elude humans, but they don\u2019t know how to compare patterns from different sources or how to interpret complex behaviors. Actionable insights can only come from a human analyst (or the kind of generalized artificial intelligence that exists only in science fiction).\n\nWe have let ourselves become enchanted by big data only because we exoticize technology. We\u2019re impressed with small feats accomplished by computers alone, but we ignore big achievements from complementarity because the human contribution makes them less uncanny. Watson, Deep Blue, and ever-better machine learning algorithms are cool. But the most valuable companies in the future won\u2019t ask what problems can be solved with computers alone. Instead, they\u2019ll ask: how can computers help humans solve hard problems?",null,null,B.i,!0,null)
B.WA=new A.q("EVERY ONE OF TODAY\u2019S most famous and familiar ideas was once unknown and  unsuspected. The mathematical relationship between a triangle\u2019s sides, for example, was secret for millennia. Pythagoras had to think hard to discover it. If you wanted in on Pythagoras\u2019s new discovery, joining his strange vegetarian cult was the best way to learn about it. Today, his geometry has become a convention\u2014a simple truth we teach to grade schoolers. A conventional truth can be important\u2014it\u2019s essential to learn elementary mathematics, for example\u2014but it won\u2019t give you an edge. It\u2019s not a secret.\n\nRemember our contrarian question: what important truth do very few people agree with you on? If we already understand as much of the natural world as we ever will \u2014if all of today\u2019s conventional ideas are already enlightened, and if everything has already been done\u2014then there are no good answers. Contrarian thinking doesn\u2019t make any sense unless the world still has secrets left to give up. ",null,null,B.i,!0,null)
B.WC=new A.q("\nAt the macro level, the single word for horizontal progress is globalization\u2014 taking things that work somewhere and making them work everywhere. China is the paradigmatic example of globalization; its 20-year plan is to become like the United States is today. The Chinese have been straightforwardly copying everything that has worked in the developed world: 19th-century railroads, 20th-century air conditioning, and even entire cities. They might skip a few steps along the way\u2014 going straight to wireless without installing landlines, for instance\u2014but they\u2019re copying all the same.The single word for vertical, 0 to 1 progress is technology. The rapid progress of information technology in recent decades has made Silicon Valley the capital of \u201ctechnology\u201d in general. But there is no reason why technology should be limited to computers. Properly understood, any new and better way of doing things is technology.\n",null,null,B.i,!0,null)
